(38, 15, 1, 1, 11, 'Mercedes', 'C 300', 2015, '2,0 L', 245, 112000, 28800, '$', 0, 'Amerikankadir, cox yungul baqaj zedesi olub. Ancaq baqaj hissede kraska isi olub. Zede olan sekilleri elave etmisem. Cox ideal veziyyetdedir, hec bir problemi yoxdur. Masina AMG diskler, AMG radiator barmaqligi (oblisovka), AMG diffuser ve qlusiteller elave olunub. SRT exhaustda AMG qazan ses sistemi yigilib. Cox ideal sesi var.  Tehlukesizlik kemerleri tund qirmizi kemerlerle evez edilib ve tund qirmizi EVO ayaq altilar yigilib. 4 sentyabr tarixinde 4 eded Kumho ECSTA paket (245/40/18 ve 265/35/18) tekerler alinib. Yan guzguler yarasa guzguye yigilib ve xususi donme isiqlari elave olunub. Kondisionerin ic ve col filtirleri deyisilib. \n\nMasinda olan funksiyalar:\n\n4 Matic (4 cekendir)\nKeyless Go\nSensor qapi destekleri (4 eded)\nStart/stop\nAutohold\nGozleme zamani muherrikin avtomatik durmasi\nPre-collision (Qeza onleyici sistem)\nOturacaq isidicileri\nBurmester ses sistemi\nEco/Comfor/Sport/Sport+/Individual rejimler\nTouchpad ve Joystick ve s.\n\nSeher ici yanacaq serfiyyati 10-12 litr, trasda 7-8 litrdir. Motor yagi 4000 km-dan sonra deyisilmelidir. Seherde diqqet cekmek ve baxislari ustune toplamaq isteyenler ucun ideal masindir.'),
(39, 9, 1, 1, 5, 'Ford', 'Mustang', 2015, '2,3 L', 317, 110000, 22400, '$', 0, 'Masinda hec bir problem yoxdur.GT500 body kit yigilib.Diskler 20 likdir.'),
(40, 14, 1, 1, 11, 'Kia', 'Cerato', 2017, '2,0 L', 150, 138900, 22300, 'AZN', 0, 'Avtomobil olkeye yeni gelib burada surulmeyib hec bir problemi yoxdur .sade motor sade korobka seple 92 benzinle isleyir.\nTekerler yeni!!! \nOrginal KATALIZATOR !!!\nAkumlyator yeni!!!\nYağ deyişilib ! \nXimçiska olunub !!\nPalirofka olunub !!\nVin: 3kpfl4a71je199427'),
(41, 6, 2, 2, 4, 'Renault', 'Megane', 2009, '1,5 L', 106, 250000, 9800, 'AZN', 0, 'Maşını Gürcüstanan özüm gətirmişəm  vuruğu udari qətiyyən yoxdur ! Təkərlər yeni dəyişilib  ne xərci olsa qiymetden kececem !!! MAŞİN TAKSİDE QETİYYEN SURULMEYİB !!!\n TECİLİ SATİLİR  ...'),
(42, 3, 3, 3, 4, 'Toyota', 'Prius', 2008, '1,5 L', 76, 199626, 13300, 'AZN', 0, '1 ci sahibiyik masin super vezyetde xerc teleb elemir takside iwlenmeyib ale mawini olub qiymete gore narahat elemeyin'),
(43, 12, 1, 2, 11, 'LADA (VAZ)', '2106', 1986, '1,3 L', 64, 222666, 3000, 'AZN', 0, 'Motor 03 kolça kladiş olmalıdı korbka 4 normal most normal 4 teze teker yüngül kosmetik işi var istəydən asılıdı çürüy yoxdu gündəlik sürülür probelm yaratmır nəticədə 86nın maşınıdı qiymət maşınln yanında razılaşmaq olar bütün xərcləri nəzərə alınıb qiymət qoymuşam '),
(44, 15, 1, 1, 11, 'BMW', '528', 2012, '2,0 L', 245, 210000, 18000, '$', 0, 'Zavod m paket qırılan m sdenikler kepenek rol,headup,qara tavan.oturacağ qızdırıcısı,soyuducusu,diskler original 20 lik m disklerdi. Bütün rasxodları qarşılanıb yağı,sepi hamsı yenilenib mator saat kimi işleyir.yürüş km-ledi.tecili pul lazım olduğuna göre satılır WİN kodu temizdi zedesi olmuyub isteyen olsa ataram.real alıcı ile qiymetde razılaşmağ olar.alanada satanada xeyrli ve uğurlu olsun.'),
(45, 6, 1, 1, 11, 'Chevrolet', 'Cobalt', 2022, '1,5 L', 106, 1200, 22100, 'AZN', 0, 'Maşin ideladi Tecili pula ehtiyac var die satiram cox dozumlu sezsiz masindi 60 ayliqdi 4600 ilkin bir ayliqin atib verecem Ayliq 478 azn Bahali ayagalti ve Plonka cekilib'),
(46, 1, 1, 2, 11, 'LADA (VAZ)', '2107', 2005, '1,6 L', 75, 223500, 5900, 'AZN', 0, 'Mawin il 2005 di qabag sag krilo deyiwib texniki baxiw kecib sigorta var cerime yoxdu mawin peredok yigilib sifirdan tezeliyce çawka feredo rulavoy karopkada matorda lazim olan deyiwilmeli salnikler deyiwilib qluwitel orta qazan radiator deyiwilib amartizatorlar zaprafka eletdirmiwem colden butun kosmetik iwleri gorulub satmagda meqsed mawin deyiwirem satmaga telesmirem fantastik endirim olmuyacag pula alanada satanada xeirlisi'),
(47, 10, 1, 2, 11, 'Dacia', 'Logan', 2007, '1,6 L', 87, 300000, 6300, 'AZN', 0, 'Gündəliy sürülən maşındı,ekanom,rasxodsuz maşındı,təcili satmalı olduğum üçün qiyməti aşağı qoymuşam.qiymət sondu'),
