(51, 16, 1, 1, 11, 'Mercedes', 'E 280', 1998, '2,8 L', 204, 344000, 15400, 'AZN', 0, '✓Nemka !IDEAL! veziyyetde.\n✓Qetiyyen xerc teleb etmir!\n✓Mashin 16 ilden cox mendedir.\n✓Mator Ideal ishleyir, yag azalma yoxdur.\n✓Karobka, Most Super veziyyetde.\n✓Rengi qusursuz tam parlaq.\n✓Salon cizig cat bele yoxdur Avantgarde.\n✓Butun detallar yalniz Orjinaldir.\n✓Faralari Stopu Orginal Hella Yeni.\n✓Sam diski ciziqsiz catsiz tekerleri Yeni.\n✓Sheherde bele E class cox azdir.\n✓Ne xerc olsa Men terefden hell edilecek\n✓Qeyd: Nomresiz Satilir.\n✓DYP xerclerini Men qarshilayacam.'),
(52, 1, 1, 1, 9, 'Infiniti', 'QX56', 2013, '5,6 L', 405, 195000, 29000, '$', 0, 'Masin ela veziyyetde serfiyati seherde 18 trasda 15-16 barter yalniz santafe ile'),
(53, 5, 1, 1, 4, 'Opel', 'Vita', 1995, '1,4 L', 90, 255000, 4600, 'AZN', 0, 'Salam. Maşın yaxşı vəziyyətdədir. Sənədlər qaydasındadır. Təcili satılır. Real alıcıya cüzi endirim olacaq.'),
(54, 6, 1, 1, 4, 'Opel', 'Vita', 1996, '1,4 L', 90, 250000, 3900, 'AZN', 0, 'Maşın normal vəziyətdədir.250-300 manat xərci var.Akkulmyator qoy sür getsin.Ciddi alıcı olsa maşının yanında razılaşmaq olar.Udarı olmayıb.pası çürüyü yoxdur.'),
(55, 5, 1, 1, 4, 'Opel', 'Vita', 1997, '1,4 L', 90, 300000, 4700, 'AZN', 0, 'Mawin her gun surulen Mawindi..Mator Pol abarot xoda duwur..Karobka yaxwi..Yagi deyiwdirilib..Remen komplekt deyiwdirilib..Matorun paduwkasi deyiwdirilib..Radiator teze qoyulub. Kondisioneri Var. Konsmetika yaxwidi. Arxa kriloda yungul cizig var..Amma reng yerinde..El vurmamaq da olar, Duzeltdirmekde..Summadan cixilacaq. Elektronikasi iwlekdir..Faralar l, stoplar, pavarotnikler, wuwe silenler hamsi iwlekdir!! Senedler Tam qaydasindadir..Texpasport teze alinib. Sigortasi Var.\n  Xaish olunur Ciddi Wexsler narahat elesinler.'),
(56, 6, 1, 1, 4, 'Opel', 'Vita', 1997, '1,4 L', 90, 242131, 4200, 'AZN', 0, 'Tecili satilir!'),
(57, 11, 1, 2, 12, 'Opel', 'Astra', 1994, '1,6 L', 75, 300000, 4450, 'AZN', 0, 'Salam.Problemsiz masindir normal veziyyetdedir.\nBir iki xirda xercleri var qiymetde nezere alinacag.\nFikri ciddi olmayanlar narahat etmesin.Telefonda qiymet sohbeti edilmir.Son qiymet masinin yaninda masina baxildiqdan sonra danisilacag.'),
(58, 16, 1, 1, 4, 'Opel', 'Vita', 1997, '1,4 L', 90, 300000, 4100, 'AZN', 0, 'Tekerleri deyismelidir.!qiymetde nezere alinacaq.Karopka mator hec bir problemi yoxdu istediyiniz ustada yoxlada bilersiniz..! Real aliciyla qiymetde razilasmaq olar .!texsmoru sxorta olub'),
