(60, 1, 1, 1, 6, 'Cadillac', 'ATS', 2017, '2,0 L', 276, 30000, 22500, '$', 0, 'Cadillac ATS coupe 2turbo mator maşın ideal və səliqəli vəziyyətdədir heç bir vuruğu udarı yoxdur bu modelin ən full variantıdır əlavə olaraq qeyd edimki auto stop da mövcuddur və benzin sərfiyyatı əladı Maşını istənilən yerdə yoxlatdıra və test edə bilərziniz.'),
(61, 13, 1, 1, 4, 'Fiat', '500L', 2015, '1,4 L', 95, 11000, 17500, 'AZN', 0, 'Tecili: masin idyal vazyatdadir hec bir prablem yoxdur  masin tacili olarak satilir bazar qiymatinan asagi qoyulub ki tez satlisin qiymat masina baxdiqdan sonra masinin yaninda danisilacaq'),
(62, 1, 1, 2, 11, 'Khazar', 'LX', 2021, '1,7 L', 113, 90000, 13500, 'AZN', 0, 'Hazir lizing\n48 aylıqdi\n13 ayi ödenib\nAylıgi 390 manatdi\nEveli 3100 manat\nTelefonda qiymet danişmayin'),
(63, 5, 1, 1, 11, 'BMW', '318', 1997, '1,8 L', 140, 116000, 8000, 'AZN', 0, 'Salam.masin axirinci ildi.saf masindi vurug udar yoxdu.mator sessizdi yag yemir,yag axitmir.karopka gecikmir vurmur.salon temizdi seliqlidi.təkərleri normaldi.kandsaner islekdi.xadavoyu yaxsidi.mostunda ses yoxdu.qiymetde cuzi endirim olacag.allah xeyr versin.AMİN'),
(64, 14, 1, 2, 4, 'LADA (VAZ)', 'Priora', 2013, '1,6 L', 106, 265000, 11200, 'AZN', 0, 'Hər şeyi işləkdir. Xırda kraska dəyən yerlər var. Əlavə məlumat üçün zəng edə bilərsiniz. Özündən ucuz avtomobil ilə barter etmək olar. Üstündə pul almaq şərti ilə'),
(65, 9, 1, 2, 12, 'Opel', 'Astra', 2010, '1,4 L', 90, 113000, 14000, 'AZN', 0, 'Almaniyadan 2 gündür gəlib\n1000% Original probeq Harda istəyirsiz yoxlada bilərsiz..\nOpel 111 İlliyinə buraxılış\nCrome paket\nYeni disk Təkərlər\nAvtomobil Çox ideal vəziyyətdədir \nPas çürük adı belə çəkməyin\nBelə vəziyyətdə Astra demək olar yoxdur.'),
(66, 6, 2, 2, 8, 'Ford', 'Tourneo Connect', 2007, '1,8 L', 110, 400015, 12600, 'AZN', 0, 'Masin idyal masindi  yuke taksiye islenmiyib .radnoy oz sinkalaridi 2 defe qatlanan .ozunden ucuz masinla barter dusnuruk. Tecili pul lazimdi. Elave melumat ucun elaqe . Wp var.'),
(67, 1, 1, 1, 9, 'Mitsubishi', 'Pajero io', 2000, '1,8 L', 160, 265500, 7500, 'AZN', 0, 'Salam diqqetle oxuyun zehmet olmasa sonra elaqe saxlayin ! mawin ideal veziyyetdedir real alicilar narahat etsin bow bowuna vaxtimi almayin mawinin sahibi xanimdir mawina baxmaq isdeyen hovsanda gelib baxa biler cuzi endirim edeceyik alverciler qeti zeng vurub qiymet oldurmesin mawina vaxti vaxtinda qulluq edilir ne sualiniz olsa elaqe saxlaya bilersuz qiymet yene deyirem 200 300 endirim edeceyik bu qeder '),
(68, 1, 1, 2, 11, 'LADA (VAZ)', '21011', 1981, '1,5 L', 65, 77250, 5000, 'AZN', 0, '1981ci ildən 1 sahibindədir.77250 original prabeg.maşin uzun illərdir yatıb qalib.ətək bir iki alt detalları dəyişib.krasklanib.bir gündə olsa belə üstünə baqaj və ya taksidə istifadə olunmuyub.difir karobka mator hamısı özününküdur.ozum üçün yigdirmisdim.pul lazım olduğundan satılır.maqintafon yoxdur.hec alandan bu günə kimi olmuyub.polka si belə deşilmiyib.real alıcıyla  razılaşmaq olar '),
(69, 7, 2, 2, 8, 'Renault', 'Scenic', 2010, '1,5 L', 110, 254000, 13200, 'AZN', 0, 'Yagış sensoru,işıq sensoru,avtopilot,kruiz kontrol,klimat kontrol,sürətlər qutusu 6+1.Kredit mümkündü,ilkin ödəniş-6000azn.Barter təklif etməyin.'),
(70, 1, 1, 1, 11, 'Chevrolet', 'Malibu', 2017, '1,5 L', 160, 114000, 22500, 'AZN', 0, 'Ozune ideal malibu axtaranlar elage saxlasin hazir lizingdedir ilkin odenisi 10800 AZN 30 ayi galib\nReal aliciya endirim edecem  masin bufer zedesi ile gelib ideal masindir 95 le surulub yalniz'),
(71, 9, 1, 1, 11, 'Mercedes', 'E 280', 2000, '2,8 L', 204, 348000, 16300, 'AZN', 0, 'Bezdetal, udarsız,vuruqsuz, təmiz maşındır.. Maşına Şüvəlanda,Mir Mövsüm Ağa ziyarətgahının yanında baxa bilərsiz.. '),
(72, 1, 2, 2, 13, 'Mercedes', 'Sprinter 311', 2008, '2,2 L', 150, 330000, 31700, 'AZN', 0, 'İşimizi bağladığımız üçün satırıq, -40 dərəcəli soyuducusu tam işləkdir.'),
(73, 4, 3, 3, 11, 'Honda', 'Civic', 2005, '1,3 L', 95, 28968, 10900, 'AZN', 0, 'Yaxsi veziyyetdedir. Gundelik surulur. \nVini sekilde qeyd olunub\nDemek olarki xerc teleb etmir. \nKreditlede elde ede bilersiz\nIlkin odenis 5500 azn\nIlkin odenis 5800 azn\n15 ay 600 azn\n24 ay 450 azn'),
(74, 15, 2, 1, 9, 'Hyundai', 'Santa Fe', 2012, '2,0 L', 184, 173000, 33800, 'AZN', 0, 'Bezkraska, 7 yerlik avtomobil ölkəyə yeni gəlib, çox səliqəli istifadə olunub ideal vəziyyətdədi və qaraj şəraitində saxlanılır, vuruğu, udarı və dəyişən detalı yoxdu, heç bir xərc tələb eləmir, motor, korobka, peredok və elektronikası saz vəziyyətdədi. İstənilən yerdə yoxlada bilərsiz. Full komplektasiya: 4 təkər çəkən, 7 yerlik, video registrator, oturacaqların qızdırılması və soyudulması, sükanın qızdırıcısı, multi rul, klimat kontrol, kruiz kontrol, start-stop, monitor, arxa görüntü kamerası, yan güzgülərin idarə olunması, dəri salon, ekonom və normal rejimlər, oturacaqların elektron tənzimlənməsi, açarsız daxil olma'),
