(86, 6, 1, 1, 11, 'Mercedes', 'E 240', 2000, '2,6 L', 170, 244268, 17000, 'AZN', 0, 'Avtomobil əla vəziyyətdədir.orijinal probeq.mator karobka most peredok və elektron sistemi tam əla vəziyyətdədir.vuruğu yoxdur.daimi olaraq səliqəli istifadə olunub və çox az sürülən maşındır.salonu çox temiz və səliqelidir.zavod vəziyyətindedir.akumlyator yenidir.mator yağı yeni deyişilib ve 5/40 havoline yağı istifade olunur.karobka və mostun yağı 15000 sürülüb.tekerler yaxşı veziyyetdedir.bilenler bilir.dörd faranın terife ehtiyyacı yoxdur.çox dözümlü rahat geniş komfortlu və mükəmməl idare olunan avtomobildir.əsl aile maşınıdır.yanacaq sərfiyyatı şəhərdə 10- 11 litr, trasda 7-8 litr olur.özünə rahat geniş komfortlu və sağlam maşın almaq isteyen və ən əsasıda hər gün ustaları gezmek istemeyen insanlar zeng vura bilerler.xahiş olunur alverçiler narahat etmesinler.'),
