(90, 6, 1, 1, 11, 'Mercedes', 'E 240', 1999, '2,4 L', 170, 280000, 13000, 'AZN', 0, 'Əvvəla Salam.Full versiya 4 göz axtaranlar zəng vursun.Öz nəslinin yüksək zövqlə istehsal edilmiş geniş və rahat komforta malik avtomobil təqdim edilir.Avtomobil öz adımadır.Səxsi maşınımdır.Avtomobildə udar,vuruq,curuy,pas əziy və.s prablemlərdən söhbət gedə bilməz.Zavod detallar,zavod krasqa.Avtomobil bu günkü gündə 1 manat belə olsun xərc tələb etmir.Ailə maşınıdır.İçi çox səliqəlidir,çexollarinda cırıq sokuy yoxdur.Avtomobilin bütün zavod blomblari üstündədir.Mator most karopka ideal vəziyyətdədir.Peredokda xırda belə olsa səs küy yoxdur.Səkillərdədə göründüyü kimi əlavə kanstruksiya quraşdırılmayıb.Masinin duruşuna, söz ola bilməz.Masin dövlət qulluqçusu tərəfindən yalnız evə,işə və ailə üçün istifadə olunub.Masin qaraj şəraitində saxlanılıb və həvəskar tərəfindən qulluq olunur.AVANGARDE-versiya full variantdır.Açarsiz daxil olma,avto pilot,yaddaşlı oturacaqlar,oturacaqların isidilməsi və soyudulması,qatlanan güzgülər,kondisioner buz kimi vurur,arxa park radar,AMG/16 DİSK TƏKƏR (YENİ),ayaq altı sensor işıqlar,Multi Sükan,Snow rejim,sağ sol guzgulərin buzlanmaya qarşı isidilməsi.Qiymetde razılaşmaq olar.Avtomobili götür apar harda kimə istəyirsən yoxlat.Razilasariq.Allah satanda alanda xeyir versin.'),
