(145, 1, 1, 1, 4, 'Audi', 'A5', 2011, '2,0 L', 211, 249500, 24999, 'AZN', 0, 'Стильная пятидверная модель, прекрасно подходящая на роль семейного автомобиля, никого не оставит равнодушным. Особый дизайн зрительно увеличивает его габариты, сохраняя при этом лёгкость и изящность пропорций спортивного купе. Мощные двигатели и по-спортивному настроенные трансмиссии в сочетании с прогрессивными технологиями марки Audi, такими как, например, опциональная система динамического рулевого управления, позволяют получить максимальное удовольствие даже от короткой поездки. Благодаря просторному салону и вместительному багажнику в Audi A5 Sportback достаточно места для поездки всей семьей. Высокая центральная консоль, глянцевые черные накладки дверей, высококачественные материалы отделки салона и горизонтальные элементы дизайна интерьера визуально расширяют пространство салона. Современная информационно-развлекательная система и опциональный пакет дополнительного освещения салона придадут интерьеру Audi A5 Sportback подчёркнутую элегантность.'),
