(159, 9, 1, 1, 11, 'Opel', 'Insignia', 2012, '2,8 L', 260, 144000, 18900, 'AZN', 0, 'Opel Insignia 2.8 V6, Limited!\n\n2013-cü ildə rəsmi dilerdən (Opel Azerbaijan) alınıb. Zavod kuzov və detallar, DVD player/AUX/CD/ MP3/ SD kart, multi sükan, kondisioner, yağış sensoru, işıq sensoru, kruiz kontrol, ikiqat yan şüşələr, antiblik qabaq şüşə, oturacaqların havalandırması.\nÇox rahat və dözümlü avtomobildir.\n100% Orijinal yürüş.\nMagistral yolda yanacaq sərfiyyatı 7-8 l / 100 km.\nYanacaq sərfiyyatı şəhər dövrü 11-13 l / 100 km.\nBenzin 92.\nBarter təklif olunmasin.\nÇox seliqeli surulub.\nMotor, karobka, peredok əla vəziyyətdədir.\nQeyri-ciddi alıcılar narahat etməsin.\nTəcili satılır, real alıcıyla maşına baxdıqdan sonra razılaşmaq olar.\n\nOpel Insignia 2.8 V6 Limited!\n\nКуплена у официального дилера (Opel Azerbaijan)в 2013 году. Заводской кузов и детали. DVD player/AUX/CD/ MP3/ SD card, мульти руль, кондиционер, датчик дождя, датчик света, cruise control, двухслойные боковые стекла, антибликовое лобовое стекло, охлаждение сидений.\nОчень комфортабельный и прочный авто без капризов.\nИсключительно оргинальный пробег.\nРасход топлива на шоссе 7-8 л/100 км.\nРасход топлива городской цикл 11-13 л/100 км\nБензин 92ой\nБартер не предлагать.\nЭксплуатировался очень аккуратно.\nМотор, коробка передач и ходовая часть в отличном состоянии.\nУбедительная просьба - несерьезным покупателям не беспокоить!\nПродается срочно.'),
