(161, 1, 2, 1, 4, 'Hyundai', 'i30', 2014, '1,6 L', 128, 76181, 23800, 'AZN', 0, 'Avtomobili Koreyadan şəxsi istifadəm üçün gətizdirmişəm.Turbo.az saytında bu komplektasiyada İ 30 yoxdur. Səbəb:hamı avtomobil gətirəndə satmaq pul qazanmaq məqsədi ilə gətirir çalışır ucuz maşın alsın ki,üzərində pul qazana bilsin mən isə ən yaxşı avtomobil seçərək gətirmişəm ucuz axtarmamışam,çünki ,məqsədim biznes deyil şəxsi istifadəm üçün olub.Şirkət tərəfindən avtomobil ilə təmin olunduğum üçün satıram. İ 30 un ən full versiyasıdır maşında olmayan funksiya yoxdur çox econom və dözümlü avtomobildir ,orjinal probeq bez kraska ,salonu təzə kimidir sideniyalarında çat qırış yoxdur.Avtomobil qarajda saxlanılır ,avtomobilə NZS qəsəbəsində baxa bilərsiniz.Alverçilər narahat etməsin.'),
