(175, 1, 1, 1, 11, 'Hyundai', 'Elantra', 2019, '2,0 L', 150, 115900, 31300, 'AZN', 0, 'Bez kraska.\n2 sade mator!  92 benzinle işleyir 1000%\nIdeal veziyyetde vin kodun şekili yerlesdirilib yoxlaya bilersiz!\nXahis edirem 1.6 ve 1.4 matorlarla muqaise etmeyesiniz!\nBarter mumkundur! Baxir teklife. \nLizing yolu ile kredite salmaqa da komeklik ede bilerem. '),
(176, 9, 1, 1, 11, 'Toyota', 'Camry', 2016, '2,5 L', 181, 58000, 32800, 'AZN', 0, 'Temiz 2016 ci il tex.pasportda da!\nOrginal yuruşu 58000 \nIdeal veziyyetdedir motor karobka xadavoy.\nVuruq udar yoxdu.\nArxa kamera.\nSrart stop.\nAcarsiz giriş.\nUzaqdan pultla masini xoda salma.\n Keramika polirovka olunub.\nMasin cox cox idealdir.xahis olunur yalniz ciddi insanlar zeng etsin.Masini alan şexs 1 manat olsun masina xerclemeyecek.\nAlverciler narahat etmesin.\nMasinda xirda problem ve ya noqsan yoxdur!\n 2 açari var. Tekerleri pirelli yaxşi veziyyetde.\nAkumlyatoru yeni 1 il qarantiyali.\n Rəngi tünd qaradir. Ciziqi batiqi yoxdur!'),
(177, 15, 1, 1, 11, 'Chevrolet', 'Malibu', 2018, '1,5 L', 163, 60500, 23900, 'AZN', 0, 'CHEVROLET MALIBU 2018 1.5 turbo benzin. Maşın mükəmməl vəziyyətdədir. heçbir problemdən söhbət gedə bilməz. 92 benzinlə çox rahat işləyir. \nprobeq:60500 mil.\nReal alıcı ilə maşının yanında razılaşma olacaq.\n \nBARTER YOXDUR'),
(178, 5, 1, 1, 11, 'BMW', '525', 2003, '2,5 L', 192, 201000, 21900, 'AZN', 0, '2003. texpasport .2003 6ci ayıdır\nZavod istehsalı salondur.\nM technic+individual .\nIdeal e39 istəyənlər üçün!\nBBS orginal rs700/701 10j 8.5j 275arxa 245ön \nSuper Sprint arxa orginal ses boqucu\nSport H&R prujinler göy rəng orginal.\nDSP 2x5in akustik audio ses sistemi.\nM5 rul\nM5 radiator barmaqlığı\nArxa və yan pərdələr\nN43 matorun elektroventelyatoru!\nMatoru 3 matordan güclüdür!\nYalnız həvəskarlar üçün!\nNömrə satılmır!\nYaq azalma yoxdur 1 qram bele. Yalnız motul 5/ 40\nDaima qarajda saxlanılıb. Ayda 1ve ya 2defe sürülüb!\nRəngi Göy Qara texpasporta da belə yazılıb!\nSalonu rulu ayaq altilarina kimi zavod istehsalı üstünde gələndir. Yəni bu masinin salonunda is görülməyib zavvvvvvvoddur!\nBarter qiyməti 23000\nPaxlava salon və ya sonradan üzlənmiş salonu olan.ve problemli maşınlarla müqaisə etməyin. \nBütün fara stoplar Hella orginal! \n   \n\nTecili Deyil!\n'),
(179, 15, 1, 1, 11, 'BMW', '528', 2015, '2,0 L', 245, 170000, 21000, '$', 0, 'Win 2015, sənəd 2014.  2 Twin turbo mator. Bakıya yüngül cızıqlarla gəlib udar vuruq olmayıb, baxmaq istəyən olsa winkod ataram.\nArxa və ön oturacaqların isidilməsi\nAçarsız giriş ( 4 qapıda)\nBaqajın ayaq jesti ilə açılması\nRul qızdırıcı\nHead up\nBöyük monitor\nDisklər yeni alınıb,təkərlər yaxşı vəziyyətdədir.\nTam olaraq M yığılıb,sənəddə qeyd olunub.\nHeçbir xərc tələb etmir tam ideal vəziyyətdədir.\nTəcili olduğu üçün dəyərindən çox ucuz satıram.\nNömrəsiz satılır.\nQiymət yalnız maşının yanında danışılacaq.'),
(180, 6, 1, 1, 11, 'Mercedes', 'S 320', 1998, '3,2 L', 231, 310000, 9900, 'AZN', 0, 'Nemka S320 1998 ci-il . Qapılar polisos baqaj polisos.\nIdeal vəziyyətdədir . Vuruq udar yoxdur!\nZavadskoydu!  Matoru karobkasi hansı eladi xahiş edirəm saytdakı bəzi leş maşınlarla müqasiyə etməyin!'),
(181, 1, 1, 2, 11, 'Ravon', 'Nexia R3', 2021, '1,5 L', 107, 19000, 16850, 'AZN', 0, 'Maşin garaj şeraitinde saklanır.\nKusursuz, hatasızdır taze maşin kokusu üzerinde servis bakımlıdır. hariçte olmamdan ötürü satılır. Zamanet 100.000km veya 3 yıldır.\nTaze maşinden farksızdır.'),
(182, 5, 1, 1, 9, 'Hyundai', 'Santa Fe', 2020, '2,4 L', 188, 25000, 31500, '$', 0, 'tecili!'),
(183, 9, 1, 1, 12, 'Mercedes', 'E 240', 2000, '2,6 L', 177, 490000, 13500, 'AZN', 0, 'Maşın ideal vəziyətdədi. Heç bir problemi yoxdur. Çürük pas vuruq qəti yoxdur. Təmiz Avangarde Full salondu. Rəngi qara metallikdi. Mator karopka most hamsı idealdı. Xadavoyu əla vəziyətdədi. Amartizatorları təzədi. Təkərlərin 4 də təzədi orginal R16 lıq şam disklər. Matorun yağı filtirləri hamsı təzə dəyşilib. Yükdə və taksidə qəti istifadə olunmuyub. Orginal ksenon faralar. Kosmetikaya ehtiyac yoxdur. Orginal mebel rul, fara yuyan, park radar, lyuk, baqaj plisos, koja salon, sdenya qızdırıcı, və.s. Zapaska təkəri yerə belə dəymiyib. Zavod tibb çantasına kimi üstündədi. Bu vəziyətdə 2 ci universal kuza yox kimidir. Qiymətdə razılaşmaq olacaq.'),
(184, 9, 1, 2, 11, 'LADA (VAZ)', '2107', 2011, '1,7 L', 80, 68000, 8800, 'AZN', 0, 'Salam maşın ideal maşındır.Tam dolu bezşumka olunmuş işlənməmiş zapaz təkərə kimi təzədir \nəsil cavan və qardaşa qismət olası maşındır.üstündə olan avadanlığı yazmaqla deyil görməklə kifayət edər tam hər biri şəkildə var.Allah alanada satanada xeyir versin İnşAllah '),
(185, 1, 1, 2, 11, 'Iran Khodro', 'Runna', 2013, '1,6 L', 110, 259877, 4500, 'AZN', 0, 'Salam yaxwi mawindi biraz xercleri var qiymetde nezere alinib endirim olacaq whatsapa  yazin zeng eymiyin. Tecili satilir'),
(186, 9, 1, 1, 11, 'Mercedes', 'C 300', 2008, '3,0 L', 231, 252400, 21400, 'AZN', 0, 'Mercedes c300 ideal veziyyetde.butun xercleri odenilib.orjinal katalizatorlari ustundedir.\n'),
(187, 6, 1, 1, 11, 'BMW', '530', 2001, '3,0 L', 231, 259000, 12900, 'AZN', 0, 'Masin nemka dir tam ideal veziyyetdedir hec bir prablemi yoxdur alverciler narahat etmesin son qiymet mawinin baxildiqdan soram danwilacaq'),
(188, 1, 1, 1, 11, 'Hyundai', 'Accent', 2011, '1,6 L', 123, 172548, 17200, 'AZN', 0, 'Serviz maşınıdır. Servizdə qulluq olunub, arginal prabeqdir, full variandır, startstop, qızdırıcı. Mator karopqa xadavoy sistemi idealdır, vuruq dəyişən detalı yoxdur. Təkərlər təzədir. Maşın hazırda heç bir xərc tələb etmir. '),
(189, 9, 1, 1, 11, 'Toyota', 'Camry', 2012, '2,5 L', 181, 160000, 33200, 'AZN', 0, '● Avtomobil 2012-ci ildə Toyota Bakı Mərkəzindən alınıb. \n● İlk sahibi özüməm.\n● Avtomobil ideal vəziyyətdədir və heç bir problemi yoxdur.\n● Real alıcıya endirim olacaq.\n');
