(190, 15, 1, 1, 11, 'Kia', 'Optima', 2013, '2,0 L', 274, 117839, 22800, 'AZN', 0, 'Mawin yaxwi veziyyetdedir,qiymeti mawina baxdiqdan sonra daniwilacaq.'),
(191, 1, 2, 2, 8, 'Mercedes', 'Vito 111', 2011, '2,2 L', 150, 320000, 32500, 'AZN', 0, 'Extralong taksidə işləməyib'),
(192, 1, 1, 1, 5, 'Mercedes', 'C 300', 2017, '2,0 L', 245, 45000, 36500, '$', 0, 'Mercedesin sənəd əsəri C300 AMG CABRIO. Aftomobil ala veziyattadi. Bos bos narahat etmiyin. Son qiymet telefonda muzakire olunmur!!!!!'),
(193, 15, 2, 2, 12, 'Opel', 'Astra', 2006, '1,9 L', 120, 335000, 9800, 'AZN', 0, 'Allah alanada satanada xeyr versin.\n1.9 dizel mator dozumli matordu bilen bilir\nYagi teze deyiwib.\nUdardan qeti soz gede bilmez.\nOz adimadir. Senedler qatdasinda\nTexasmotr ve sigorta olunub\nYagi yeni deyisib. (5/30 alpine)\nAzalma qeti yoxdu.\nIstediyimiz yerde yoxlada bilersiz\nButun sistemi.iwlekdir.\nKondissioner ve pec hamsi iwleyr ela \nYalniz.tekerleri zeifdir.\nSatma sebebim mexanika sure.bilmemekdir.\nTurbosu fevralda deyisib.\nIdeal cekmeyi var. \nVp var. \nKreditde mumkundur. \nIlkin odenis 5000 min\nLizinq.yolu ile.'),
(194, 6, 1, 1, 11, 'Toyota', 'Corolla', 2001, '1,5 L', 110, 216000, 10500, 'AZN', 0, 'Salam maşının xadavoyu , karobkasi matoru super vəziyyətdədi dəyişən detal yoxdur. Yalnız cüzi kasmetikaya ehtiyaci var.'),
(195, 6, 1, 2, 11, 'GAZ', '3110', 2003, '2,3 L', 131, 180000, 3600, 'AZN', 0, 'Mawin ideal veziyyetdedir hec 1 problemi yoxdu'),
(196, 9, 2, 2, 11, 'Hyundai', 'Sonata', 2006, '2,0 L', 140, 520000, 11700, 'AZN', 0, '2.0 dizel mexanikadır çox rahat və ekanom maşındır. Kosmetikaya ehtiyyacı yoxdur. Yüngül xərcləri var qiymətdə nəzərə alınıb belə qoyulub gündəlik sürülən maşındır normal vəziyyətdədir. Təzə təkərlər xrom disklər. Təzə akkumulyator alınıb heç üstünə qoşulmuyub manitor filan bir sözlə bu qiymətə Sonata yoxdur özüdə dizel heç yoxdur. Real alıcıya cüzi endirim olar barter baxır təklifə'),
(197, 5, 2, 1, 11, 'Mercedes', 'C 220', 1999, '2,2 L', 125, 303012, 13700, 'AZN', 0, 'Salam aleykum. Maşın yaxşı vəziyyətdədi '),
(198, 6, 2, 2, 8, 'Mercedes', 'Vito', 2000, '2,2 L', 122, 500000, 15000, 'AZN', 0, 'Razılaşma yolu ilə'),
(199, 11, 1, 1, 9, 'Toyota', 'RAV 4', 2007, '2,0 L', 150, 138730, 21000, 'AZN', 0, 'Toyota RAV-4 qızılı rəng, 2007-ci ilin full variantı, gedişi orijinaldı, əla vəziyyətdə. Oturacaqlar təbii dəri, güzgülərin elektron qatlanması və nizamlanması. Lyuk start-stop işə salma, 2 komplekt pult açarlar, 4 ədəd təzə Nexen təkərlər, aluminium disklər, Türkiyə istehsallı “Mutlu” akkumulator 63 güclü - 680 soyuq halda motoru işə salma gücü (01.08.2022-ci ildə qoyulub). Startyorun iç detalları şotkası, vilkası, yakoru hamısı oriqinal Yaponiya istehsalı, 24.08.2022-ci ildə dəyişilib və onların sənət-qaimələri saxlanılır. Sükan və ötürücünün başlığı təzə vəziyyətdə. Salonun döşəməsinin örtüyü əla keyfiyyətli xarici istehsal materialla təzələnib. Motor və korobka əla vəziyyətdə, yağları 2 ay öncə dəyişilib. Motor yağ yemir, tam saz haldadır. Maşının udarı olmayıb, avtomaşın sığorta və texniki baxışdan təzə keçirilib. Banın üzərində zədə yoxdur. Heç bir xərcə ehtiyacı yoxdur. Amartizatorları təzə yığılıb doldurulub. Avtomaşının qapılarının oqraniçitelləri təzə dəyişdirilib və qapılar pilləli olaraq əla açılır. Avtomaşın öz adımadır. Nömrə nişanları avtomaşının üstündə hədiyyə verilir. Konkret olaraq, otur-sür maşındır.'),
(200, 15, 1, 1, 11, 'Mercedes', '190', 1991, '2,0 L', 122, 321500, 5600, 'AZN', 0, 'Yaxşı veziyededir ela maşındır mator karopqa ela kredit  2600 azen ce 18 300 azen'),
(201, 9, 1, 1, 11, 'BMW', '535', 1997, '3,5 L', 245, 247450, 10000, 'AZN', 0, 'Mawin cox gozel vezyettedi. Sade 3.5 bez vanus M62 muherrik, korobka idealno, teze tekerler teze tyagalar,Mpaket disk, kandisioner her wey iwlek vezyettedi, xirda xercleri var. Barter ederem Gazel, Ford Tranzit, baxir mawina. Whatsapp aktivdir.'),
(202, 1, 1, 2, 11, 'LADA (VAZ)', '2107', 2005, '1,6 L', 75, 86000, 4500, 'AZN', 0, 'Gündəlik sürülən maşındır. Rəngləmədən yeni çıxıb. Gün ərzində zəng edib ətraflı məlumat ala bilərsiniz.'),
(203, 1, 1, 1, 11, 'Mazda', '6', 2007, '2,0 L', 147, 289213, 11600, 'AZN', 0, 'Masin ideal vezyetdedir '),
(204, 5, 1, 1, 11, 'Mercedes', 'E 230', 1997, '2,3 L', 150, 360865, 10500, 'AZN', 0, 'Gundəlik surulən masindir xadavoyu super vezyetdedir xais olunur ancaq real alicilar narahat etsin'),
(205, 15, 1, 2, 9, 'LADA (VAZ)', 'Niva', 2018, '1,7 L', 80, 66000, 17500, 'AZN', 0, 'niva 40anniversary 2018(texpasport) ci ilde Azerbaycana gelib\nyubiley buraxılışdı (mehdud sayda) .S guzgu (orginal) momo rol,pioneer orginal 3 qat beswumka olunub.Fikri ciddi olanlar elaqe saxlasin'),
(206, 9, 1, 1, 11, 'Mercedes', 'C 250', 2011, '1,8 L', 204, 191500, 26000, 'AZN', 0, 'Mawin ideal veziyetdedi hec bir xerc teleb etmir\nOz Mawinimdi 3 aydi Amerikadan gelib \nYaglar deyiwilib Mator/Karobka \nCox seliqeli istifade olunub hem burda hem orda \nAvtomobile baxdiqdan sora cuzi endrim olunacaq \nMawinin cox az sayda buraxilan tund yaw asvalt rengi var (qara)\n\nWDDGF4HB2CA613672'),
(207, 1, 1, 2, 11, 'LADA (VAZ)', '2107', 2009, '1,5 L', 65, 954258, 5500, 'AZN', 0, 'Salam tecili satilir oxu zeng vur masinda vuruq udar prablem sorucmayin xadovoy mator mosd karopka super bos bekar adamlar yiqmasin tecili satildiqina gore bu qiymete qoymusam adimuza aformutdu 2500 azn verilse kredite salmaq olar masin100%zavodu qiymet sondu'),
(208, 9, 1, 1, 11, 'Mercedes', 'CLS 350', 2011, '3,5 L', 306, 92000, 27000, '$', 0, 'AMG paket. Zehmet olmasa yalniz ciddi maraqlananlar narahat etsin.Təcili satıldığı üçün bu qiymətdi.'),
(209, 3, 2, 2, 10, 'JAC', 'T8', 2022, '2,0 L', 139, 1950, 46200, 'AZN', 0, 'Jac T-8 Pro\n22 08 2022 tarixdə alınıb \nBarter Olunmur \nNömrə satılmır \nYeni avtomobildir \n360 kamera \n'),
(210, 6, 1, 1, 11, 'Mercedes', 'E 240', 2000, '2,4 L', 170, 250000, 14600, 'AZN', 0, 'Maşın tam sağlmam maşındır dəyşən detlı yoxdur.\nVuruğu udarı yoxdu bütün rasxodları ödənlib.\nMaşına baxmaq isdəyən Gəncədə baxa biləlr.\n'),
(211, 6, 1, 2, 11, 'GAZ', '31105', 2004, '2,3 L', 131, 272300, 5500, 'AZN', 0, 'Salam maşın tam idiyal veziyetdedi vurugu udarı pası curuyu yoxdu mator karopqa difer super veziyetdedi peredok əladır.'),
(212, 1, 1, 1, 9, 'BMW', 'X3', 2011, '3,0 L', 306, 33900, 35000, '$', 0, 'Evropeyka , servis  masinidi , improtex  motorsdan  alinib  ve  servisinde  qulluq  olunub  ,  cox  ideal , demek olar   sifir \n veziyyetindedir  ,  tezeden  secilmir  ,  bezkraskadi  ,  masin  polnu  fuldu  ,  4  cekendi  ,  elave  olaraq  masinda  ozu  masini  sondurme  ve  ise dusme  funksiyasi  da  var  ,  probeq  orijinaldi  !!! ,  masin  qaraj  seraitinde  saxlanilir  ve  az  istifade  olunub  ,  yurus  33 900  kilometirdir  ,  motoru  3.0  benzindir  ,  bu  bmw  masinlarinda en  yaxsi  motordu  ,  bir  sozle  masina  soz  yoxdu   ,  bu  modeller x5  ,  x6  -dan  bir  az  kicikdir  ,  realliqda  cox  gozel  gorunusu  var  ,  masini  harda  istesez  yoxlada  bilersiz  .'),
(213, 5, 1, 1, 9, 'Mercedes', 'GLE 400 Coupe', 2015, '3,0 L', 333, 75500, 60000, '$', 0, 'Masin Ideal veziyyetdedi,qaraj masinidir. AMG paket. '),
(214, 6, 1, 2, 11, 'Kia', 'Avella', 1998, '1,5 L', 92, 233300, 5300, 'AZN', 0, 'Hidravlik rol. Kondisioner buz kimi işlək. Peç işlək. Arxa görüntü kamerası işlək. Pioner maqnitofon. Çəkimi superdi. Buta palacen padyomunu 5lə rahat  qalxır. Sürənlər bilir bu nə deməkdi. 4 təzə Lassa təkər. Qranatlar təzə. Motor yağı 5gündü dəyişilib. Amartizatorlar zapravka olunandır. Karopka yağı təzə. İç remen təzə dəyişib. Otur hara istəyirsən sür. Zapçastları var hər yerdə var. ölü xanası da  ustası Biləcəridə Klub avtoservisdə. Bızi zapçastlar saipa ilə eynidi. Hava filteri, injektor sistemi, kondisioner sistemi. Və s. Telefonda qiymət danışılmır. Gəlib baxan maşını alacaq. Halallaşarıq gedər. Rusun maşınından çox üstündü. Probeq orginaldı. 2-ci sonra 3cü maşın olub.'),
(215, 1, 1, 1, 11, 'Kia', 'Optima', 2014, '2,0 L', 274, 130000, 26500, 'AZN', 0, 'mawin hazir liziqdedir hec bir prablemi yoxdu yeni gelib burda surulmeyib butun rasxodlar gorlub ilkin odeniw 19800 manat aylig odeniwi 780 manat'),
(216, 6, 1, 2, 11, 'LADA (VAZ)', '2115', 2007, '1,6 L', 80, 240000, 7000, 'AZN', 0, 'Maşın ideal vəziyyətdədir öz adımadır.Qlapan əyilənnən deyil.'),
(217, 9, 1, 1, 11, 'Nissan', 'Tiida', 2011, '1,5 L', 109, 65000, 13900, 'AZN', 0, 'Tecili satılır maşın Yeni Yasamalda baxa bilersiz.'),
(218, 3, 2, 1, 9, 'BMW', 'X5', 2003, '3,0 L', 218, 249000, 26000, 'AZN', 0, 'Salam.\nMotor M57 motordur. Dözümlüyünə görə ən gözəl dözümlü matordur. Avtomobil əlavə olaraq at gücü gücləndirilib. Yanacaq sərfiyyatı 9-10 l dir. \nAvtomobil restayling yığılıb. Buferlər, faralar və s.\nStart stop, kənardan mühərriki işə salma, Keyless go & 360 ° Kamera və Reqistrator quraşdırılıb. Disklərin diametri 20 lik,  Klimat kantrol, Oturacaqlar elektrondur.\nBarterə üstünlük verilir. WhatsAppa yaza bilərsiniz.\nAvtomobilə baxdıqdan sonra qiymət də razılaşmaq olar.'),
(219, 15, 2, 2, 11, 'Toyota', 'Corolla', 2010, '1,4 L', 90, 181000, 18700, 'AZN', 0, 'Salam Alekum\nMawin teze gelib, bir heftedi\nBezkraska bez detal, ideal veziyete\nHec bir herc teleb etmir, otur sur\nTrasta 4 liter dizel iştetir, şəhıərdə 6-6.5\nçürük pas yoxtu, original probeg'),
(220, 6, 1, 1, 11, 'Mercedes', 'C 200', 2001, '2,0 L', 163, 290000, 11800, 'AZN', 0, 'Alman maşınıdır'),
(221, 16, 1, 1, 4, 'Opel', 'Astra', 1998, '1,6 L', 105, 396452, 8400, 'AZN', 0, 'Salam. Mawin yaxsi veziyetdedir, gundelik surulen masindir, prablemi yoxdur, karopka, mator teze yigilib, Masinin yaninda endirim olacaq.'),
(222, 1, 1, 2, 4, 'LADA (VAZ)', 'Priora', 2013, '1,6 L', 106, 94000, 8900, 'AZN', 0, 'Kosmetik ishler var umumi.xodovoyu yaxshidir.az surulub.ilk sahibiyem.kondisioner ela ishleyir.'),
(223, 10, 1, 2, 11, 'LADA (VAZ)', '2107', 1997, '1,6 L', 75, 900000, 4800, 'AZN', 0, 'Salam.mawin oz adimadi hec bir pirablemi yoxdu motor 03 .beznomerdi senetderi tam qaydasinda karopqa 5 di.maqetafon pioner 4 kalonka arginal.ne suvalniz olsa buyurun'),
(224, 6, 1, 1, 11, 'Volkswagen', 'Passat', 2002, '1,8 L', 170, 400000, 5700, 'AZN', 0, 'Salam mawin deyerinden awagi satilir kicik problemleri var qiymetden cixilacag 2022 nin suallarin vermeyin 7 il bu mawin mende olup hec bir vaxt yolda qoymayip baximli mawindir mator turbo karopka saz veziyetdedir mawinin xadavoyu yeni yigilip ayag alti iwiqlar manitor araxa kamera ile tehciz olunup arxa sag qapida surtuk var kraskaya ehtiyaci var kasmetikaya ehtiyaci var biraz elave melumat ucun zeng edin'),
