(263, 1, 2, 1, 9, 'Hyundai', 'Santa Fe', 2014, '2,2 L', 197, 141000, 24600, '$', 0, ' Hyunday Santafe . Evropeyka. 2.2 dizel.  Full 7 yerlik  . Dami butov Ponorama. 2014 cu ilde Bakidan resmi diler Hyunday Otoplazadan alinib. 1 sahibi olub, 2 acari ehdiyyat acari var.  Sade 2.2  Dizel mator ( evro 2 dizel  ) . Prabegi orijinaldi 100%. Reng deymeyib 100%.  Texniki xidmetlerin coxu Resmi Servisde gorulub . Koreyadan gelen 2.0 dizel matorlari olan,. 500000 km getmish,  Katalizatorsuz, 2 tekeri ceken,  sonradan prabegi cekilmish, lodka renglenen , sigortalardan alinan mashinlarla mugaise elameyin.Butun rasxodnikler yenilenib [  4 eded teze teker 1400 azn Matador by Cantinental , teze Varta AGM  akkumlyator 350 azn.,  Orjinal Dabl Mat ayagaltilari + bogajin rezini 200 azn., matorun butun padushgalari yenilenib orijinal 850 azn., xadavoyunda rezinler, nakladkalar ,  orijinal  yenilenib, karobkanin, matorun, rulevoyun, soyutma mayesi , arxa gabag mostlarin , aylecin butun mayeleri , kandisionerin freonu yenilenib. ] Katalizatoru orijinal zavoddan uzdunde gelendi.  Shushelere Lumar  Antiblik plonka vurulub  170 azn.Keramik palirofga olunub  350 azn. Salon polun xalcasina geder sokulub kimyevi temizlenib 200 azn.Butun shusheler partpress garishig mashinin usdunde zavoddan gelendi. Tezelikce tek kosmetikasina  ve Xadvoyuna 3500 azn den cox pul goyulub [  resmi hesabati   tegdim eda bilerem ] .Ozune lesh mashin almag isdeyen, umimiyyetle texnikadan bashi cixmayan, mashinin idealligini gebul elameyen bezileri xaish edirem geti narahat elameyin.  Ideal Santafe ozude  Evropeyka Servis 2.2 dizel nadir hallarda tapilir.  Evle , torpagla barter olunmur.Barter yalniz likvid Avtomobil ile.Mator sakit ishleyir ve gara tusdu buraxmir. Yanacag nasosu, Xadavoyu, Razdatkasi, Matoru, Karobkasi, Kuzasi, elektronikasi ideal veziyyetdedi. Bu modeli surenler  bilir suretli ve dozumlu oldugunu.'),
(264, 1, 1, 2, 11, 'Saipa', '132', 2013, '1,3 L', 75, 147000, 6500, 'AZN', 0, 'Mashinin bu gunki gunde hecbir xerci yoxdur.Mator karopka ideal vezietdedir.Rulavoy sistemi her wey iwlek vezietdedir.Qranatlar yaxshidir.Alt ust iwiqlar hamsi orjinal led ile evez olunub.Vuruq udar qetiyyen yoxdur.Tekerler saipanin zavodskoy oz tekerleridir.Weherdede sayilib secilen mashinlardandir.Ne prablem olsa pulundan cxilacag.Ozune normal saipa mashin alanlar buyurub gele biler.'),
