(305, 9, 1, 1, 11, 'Volkswagen', 'Passat', 2004, '1,8 L', 170, 319000, 5900, 'AZN', 0, 'Bu elan tərifli ,bəh-bəhli maşın elanı deyil,real elandı və nə varsa o yazılıb,kimə maraqlı olsa real adam zəng estin,boş-bekar,alverçilər yığb vaxtımı almasınlar.Maşın 2012-ci ildə Amerikandan Gürcüstana gəlib,ordanda özüm gətirmişəm,Azərbaycanda ancaq mən sürmüşəm.Maşında 4 təkər çəkir (AWD).Benzin sərfiyyatı sürməkdən asılıdır və şəhəriçi 10-12 litr,trasda 5-6 litr.\nMaşının necə maşın olduğunu onu sürənlər bilir ki,canavardı.Amma,bu maşında görüləsi işlərdə var,ona görə işləri nəzərə alıb real qiymət yazıram.\nTəkərləri keçən qış dəyişmişəm,rahat 2 sezon gedər hələ,\nKruzit kontrol(avtopilot) işləkdir.\nYağı 5W-40,təzə dəyişmişəm,\nYayada kondionsioneri superdi,buz kimi olur maşın.\nMonitor(aux,bluetooth,fleşka,dvd,radi)+zavodskoy magnitafonuda verirem üstündə\nAyaqaltılarda işıq (pultnan,müxtəlif rənglər)\nTexosmotr ,siğorta sentyabr ayında olunub artıq.\nTurbosunu 2 ay bundan qabaq dəyişdim ,yağ yeyirdi.\nKorobkanın yağını 2 ay qabaq dəyişmişəm.\nGörülməli işləri və xərcini yazıram qabağında.Bu xərcləri maşının real qiymətindən çıxıb,ələ çatan 5800 azn yazmışam artıq.Ona görə qiymət söhbəti eleməyin.\nAbs-in sol datçiki dəyişilməlidir,getməyinə təsir etmir,sadəcə işığı yanır(datçik+usta), -70azn\nPotolok dəyişilməldir(sallanmır,ama vaxtıdır),-120azn\nSürücünün oturacağı nasazdı (şəkildə var) -50azn\nPeçin radiaotoru dəyişməlidi (radiator+usta haqqı) -170azn\nTəcili satılmır,ona görə birdə xahiş edirəm qiymət öldürənlər vaxtımı almasınlar.'),
