(315, 6, 2, 2, 4, 'Opel', 'Corsa', 2007, '1,3 L', 90, 228000, 9800, 'AZN', 0, 'Allahın salamı olsun hər kəsə.Aftomobil 07.08.2022 tarixində gömrük olunub..Almaniyadan sürulərək gəlib..Alman şəkılləri mövcuddur istəyənə göstərə bilərəm..Aftomobil tam saz vəziyyətdədir..Orqinal probeq,orqinal katalizatoru üstundədi...Maşinda yagış sensoru,işıq sensoru,afto pilot,multi rul,AUX movcuddur.MP 3 maqnitola,kondisioner buz kimi vurur.Maşinda salonun gužguleri və yan güzgulər uzaq vuran işıqlara qarşı tənzimlənəndi..Bütün funksiyalar saat kimi işləkdi.Dördüdə təzə HANKOOK TƏKƏRLƏR..ZAPAS TƏKƏRİ,DAMKRAT VƏ TƏKER AÇARI MOVCUDDUR..Qısası saz maşın istəyən buyurub gələ bilər..İnşəAllah Əminəm ki gələn adam maşını alıb aparacaq.Maşına baxdıqdan sonra endirim olacaq..Hər bir işləməy hissəsi olarsa mən tərəfdən qarşilanacaq.Allah Alanada satanada xeyir versin.'),
(316, 5, 1, 1, 11, 'Toyota', 'Corolla', 2015, '1,8 L', 132, 45000, 24000, 'AZN', 0, 'ÇOX TƏCİLİ DƏYƏRİNDƏN UCUZ SATILIR! TOYOTA CAROLLA SPECİAL EDİTİON! 2015 Model! Avtomobil tam ideal vəziyyətdədir. Full komplektasiya: multi -rul, dəri-parca salon, arxa kamera, R17 diskler, adoptiv CRUİSE-CONTROL, climate control, 4 teze teker! Udar görmüş suda batmış airbaglari açılmış masinlarla bir tutmayın! Xaiş edirəm qeyri ciddi şəxslər qəti narahat etməsin! Real alıcıyla razilaşacam. '),
(317, 11, 2, 2, 3, 'Mercedes', 'Sprinter 315', 2009, '2,2 L', 109, 258852, 24500, 'AZN', 0, 'Mator most karopka heç bir problemi yoxdu kuzanin uzunu 3.30 du 3 aydi Gelib Azerbaycana barterde olar 8+1 20+1mikroavtobus la qiymet ferqi yoxdu baha ucuz'),
(318, 9, 2, 2, 12, 'Renault', 'Megane', 2006, '1,5 L', 110, 252000, 9800, 'AZN', 0, 'Avto 2021 ilin oktyabr ayinda bakiya gelib aparatnan yoxlanilib her yeri zavod kraskasidi birdene arxa bagac kraskalanib.texnikasi idealdi 6 ay surenen sonra feredo cawka orginal qoyulub maxovik yaxwi vezyetde idi yoxlanilib hele 100000 geder turbo,yag nasosi ve vkladewler 1 aydi deywilib turbo tokmuwdi ustundeki zavod idi bu o demeydiki turbo 250000 rahat gedir yani tez tez tokmir dizel rasxodu trasda 4l weherde 5.5l.xaiw olunur bow bow suallara gore  narahat elemeyin satmagcin yanmiram konkret almag fikri olan adam yigsin qiymetden endirim 500-1000 olmayacag endirim olacag konkret bir weye yani ximcistka ve saire.barter olunur wevrolet cruz'),
(319, 15, 2, 2, 4, 'Toyota', 'Corolla', 2005, '1,4 L', 90, 185400, 11700, 'AZN', 0, 'Kredit\n2700 azn ilkin \n20 ay 450 azn\nKondisioner iwlekdir\nBu gunku gune hec bir xerci yoxdur bir manat bele\nUdari vurugu yoxdur\nEl eteyi kraskalanib parlofka olub\nDetal deyiwmeyib \nWhatsapp da yazin cavab verilmese.11 den sonra narahat etmeyin'),
(320, 9, 2, 1, 9, 'Land Rover', 'Discovery', 2014, '3,0 L', 249, 153000, 37800, '$', 0, 'Masin ideal veziyyetde..Hecbir problemi yoxdur.Servis masinidir.Bez kraska.En ful variantidir.3 luk.7neferlik.Harda istesez yoxlatdira bilersiz.Alverci deyilik'),
(321, 9, 1, 1, 11, 'Mercedes', 'E 240', 2000, '2,4 L', 170, 299252, 14800, 'AZN', 0, 'Salam təcili satılır heç bir xərc tələb etmir '),
(322, 9, 1, 1, 4, 'Nissan', 'Tiida', 2008, '1,6 L', 110, 190000, 13300, 'AZN', 0, 'Maşın perekitka deyil servis masinidir\nALVERÇİLƏR  ve dexlisiz suallarla narahat etməyin!!!\nMaşına Mərdəkan da baxmaq olar\nYalnız real alicilar narahat etsin!'),
