(324, 9, 1, 1, 11, 'Mercedes', '190', 1990, '2,0 L', 122, 273404, 6800, 'AZN', 0, 'Salam masin ideal veziyyetdedir hec bir problemi yoxdur'),
(325, 1, 1, 2, 12, 'LADA (VAZ)', 'Vesta SW Cross', 2019, '1,8 L', 122, 42000, 22500, 'AZN', 0, 'Xezer Ladadan alınıb 0 kmdən özümdədir. Bez kraska. Zövqə görə yığılıb. Yurol tuning arxa ön qabaq buferlər. Wrangler dumannı. İdeal vəziyyətdədir. Heç bir problemi yoxdur. Fikri ciddi şəxslər əlaqə saxlasın.'),
(326, 7, 1, 1, 9, 'Hyundai', 'Tucson', 2007, '2,0 L', 140, 274000, 15300, 'AZN', 0, 'Qeyd etdiyim usdunluklerin her biri var.\nMator yaqi deyisilib .karobka yaqi deyisilib ..eylec diskleri ve eylecler yenisi ile evez olunub bir sozle masin xerc teleb etmir .otur sur ..masin bine qesebesinde olur ..qarajda saxlanir hazirdada surulmur.qiymet baresinde real aliciya masinin yaninda endirim edecem.elave olaraq deyim ki masin 2007 ci ilin masinidi qeyri mumkunduki vuruqu olmasini ama hec bir udar gormeyib yoxlatmaq isdeyen isdenilen yerde yoxlada biler xerci ne olsa nezere alinacaq'),
(327, 9, 1, 1, 11, 'Mercedes', 'E 240', 2002, '2,6 L', 170, 231000, 16800, 'AZN', 0, 'AVANGARD ! Rengi Milyoner !\nXais eliyirem diqqetle oxuyub sonra yigin.Avtomobil ideal veziyetdedir,bugune 1 manat xerc teleb elemir.Vaxti vaxtinda Qullug olunub,Yorulmuş maşin deyil.\n- 4 Matic Deil, Sade Amartizator !!! YEVROPEYKA  ( servis masinidir )\n-100 Faiz Renglenmiş Maşinlardan Deyil\n- 4 Teze Teker (Salafan alinib qoyulub Ustune ) R18 AMG Diskler orijinaldir (Eyrisi Çati Svarkasi Yoxudur )  \n-Android Manitor Orijinal ( blutouz,wifi ve s)\n-AMG Qazan Akrapovic Nasatkalar Orijinal \n-Zavod Ksenon,Bahali Ledler Hamsii ( Dalni Vuranda Lupa Asagi Yuxari Hereket eliyir )\n-Dönen Fara,Fara Yuyan,Yagis sensoru,isig sensoru,Güzgü Qizdiran ve s.\n-4 zonali klimat ( qabag basqa,arxa basqa ) \n-Sag Sol Yaddasli Oturacaglar, Arxa Ve qabag Oturacag qizdirani,Qabag DISTRONIC , KEYLESS GO VE S...\nMaşinda Elave olarag Çox Şeyler var alan oglana hamisin gösterecem.\nÖzüne 100 panarama içinnen seçilen Maşin almag isdiyen Real alici Narahat etsin.Üstünde 1000 Aznlik Nömre Var.'),
(328, 5, 1, 1, 11, 'Chevrolet', 'Cruze', 2016, '1,4 L', 153, 68000, 16800, 'AZN', 0, 'Evvala salam masin ela veziyyetdedi ureyiviz harda istesez yoxlada bilersiz ozum secib alib getirmiwem ciziqlari olub deye lotka kraskalanib hec bir şarı atmıyıb.PERFOMANCE service(chevroletin resmi dilleri) orda qulluq olunub tex pasportnan yoxlada bilersiz.teze masinnan secilmir real alicilar elaqa saxliya biler vind 2017 hec bir vuruq yoxdu.tex 2016\n1G1BE5SM0H7113935'),
