(330, 6, 2, 2, 4, 'Kia', 'Rio', 2006, '1,5 L', 109, 250000, 11500, 'AZN', 0, 'SATILMIR!! Gundelik arendaya verilir\nBakida surulmuyub yeni gelib.ideal veziyyetdedir\nIlkin odenis 600 manat\nGunu 25 manatdan 36 ay sonda surucuye qalmaqla\n30 yasdan yuxari aileli suruculer muraciet etsin'),
