(334, 3, 3, 1, 11, 'Hyundai', 'Sonata', 2020, '2,0 L', 150, 4300, 36900, '$', 0, 'HYBRID❗❗❗\nBuraxılış ili-2020\nVurulmayıb,buferinə belə rəng dəyməyib ❗❗❗\nOrjinal yürüş \nTəzəliyindən Bakıdan alınıb və çox səliqəli idarə olunub\nYanacaq sərfiyyatı 5-6 Litr\nÖn oturacaqların isidilməsi\nMühərrikin pultla kənardan işə salınması ❗❗❗\nYan və arxa pərdələr\nSport,ECO,Comfort rejimlər\nBOSE audio sistem\nÜnvan: Badamdar maşın bazarı salon Automall\nInstagram: automall_azerbaijan'),
(335, 9, 2, 1, 9, 'Mercedes', 'ML 320', 2008, '3,0 L', 224, 330000, 24000, '$', 0, 'Sade 642 motordu blutech deyil\n2 il qabaq  Almaniyadan getirilib burda tek sahibiyem ilk gunden\nÖz sinifinin en full modelidi diger maşınlar ile müqayisə edə bilərsiz. \nMaşınının bütün rasxodnikleri yeni deyişilib tekerlerine kimi , hec bir xerc teleb etmir.motorun sepine kimi hamisi yenidi.\nReng deyen yeri Vuruq udar olmayib istenilen yerde yoxlatmaq olar.\nSaja filtr yerindedi sokulmeyib.\nEtrafli maşına baxan zaman goressiz.'),
(336, 15, 1, 1, 9, 'BMW', 'X5', 2015, '3,0 L', 306, 58000, 45500, '$', 0, 'BMW X5 M Ayrodinamik paket \nOrijinal yürüş! \nX-Drive (4 çəkən / 4x4)  \nCARFAX tərtəmiz \nBEZKRASKA \n21-lik m diskler \nÖn və arxa park radarları/arxa kamera \nAdaptiv ksenon on fenerler \nConnectedrive \nComfort access \nTam panoramik qara antizit tavan \nShadow line \nHeap-up Display \nYaddasli on Comfort sideniyalar \nM multifunksional sukan \nOn ve arxa oturacaq qizdiricilari \nAuto-Hold \nHarman Kardon surround ses sistemi \nEco/comfort /sport/sport + Eco rejimler \nStart/stop/ I-stop \nSamaparkovka \nYolsuzluq rejimi \n4 zonali clima control kondisioner \nArxa baqaj knopka ile \nTexniki ve ya elektroniki hec bir problemi yoxdur,ideal vəziyyətdədir\nÖzünə ideal vəziyyətdə X5 (F15) axtaranlar buyursun!'),
(337, 15, 2, 2, 4, 'Toyota', 'Corolla', 2006, '1,4 L', 90, 181000, 15100, 'AZN', 0, 'Masin yeni gelib olkeye.vurug udari yoxdur.tam ideal veziyetdedir.'),
(338, 11, 2, 2, 4, 'Opel', 'Astra', 2007, '1,3 L', 90, 198000, 10800, 'AZN', 0, 'Təcili satilir'),
(339, 3, 1, 1, 9, 'Hyundai', 'Santa Fe', 2014, '2,4 L', 175, 80600, 38000, 'AZN', 0, '2015 tarixində Hyundai Servis almışıq, əvvəldən özümüzdədir. 4WD, 7 Yerlikdir. Rəng Boz metallik. Orijinal Yürüş 80.600km, zərbə/vuruq olmayıb, yalnız sol krılo sürtülmə səbəbindən rənglənib. Daim rəsmi servisdə xidmət göstərilib, kitabçası da var. Zəmanəti bitib. Heç bir xərci yoxdur, daimə garajda saxlanilib. Son qiyməti yalnız yerində baxanda razılaşacam. Elmlər Akademiyası metrosuna yaxın yerləşir'),
(340, 5, 2, 2, 3, 'Ford', 'Transit', 2008, '2,2 L', 125, 270000, 24800, 'AZN', 0, 'Avtomobil 20.05.2022-ci il tarixdə Hollandiyadan gəlib.\nMühərrik 2.2 TDCİ (347) sadə turbodur.\nSürətlər qutusu 5 pilləlidir.\nÖtürücü öndür.\nAvtomobilin salonu yeni kimyəvi təmizlənmə olunub.\nMühərrikin yağı \"German Gold\" 5-30 yağı ilə dəyişib.\nYağ, yanacaq, hava və kondisionerin filtirləri yeni dəyişib.\nAvtomobildə zavod istesalı yük lifti var və sökülüb quraşdırılması 4 boltdur.\nTexniki baxış və siğortanın 20.05.2023-cü il tarixə qədər müddəti var.\nReal alıcı 24 saat narahat edə bilər.\nAvtomobilin yanında cüzi endirim olacaq.\n'),
(341, 2, 1, 2, 11, 'LADA (VAZ)', '2106', 1986, '1,5 L', 65, 228590, 4500, 'AZN', 0, 'Masin oz adimadi tam yigilmis birdenede olsin curuyu vuruqu yoxdur mator 011 niva valiyla yigilib karopka 4atmaqi yoxdur obsi masin pult sisdemidi dordene teze teker altinda akimlyator teze alimisam masinin yaninda cuzu endirib edecem'),
(342, 6, 2, 1, 12, 'Mercedes', 'E 220', 2008, '2,2 L', 170, 277854, 21200, 'AZN', 0, 'Almaniyadan yeni gelib.Frankfurt şeherinden sürülerek Bakıya gelib.Yəni Almaniyadan texniki baxışdan keçib Aftobana buraxılsın.Bir başa birinci sahibinden alqı satqı olunub.Aftomabil idall veziyyetdedi.Aftomabil çox seliqeli idare olunub.Detallar hamısı zavodu.100%Arginal prabeqdi.2.2 SDİ 646 MATOR 17PS.'),
(343, 3, 1, 1, 9, 'BMW', 'X5', 2013, '3,0 L', 306, 192000, 30000, '$', 0, 'Orijinal m paketdir. İl yarımdır ölkəyə gətirilib. Bütün rasxodniklər dəyişilib. Yeni təkər dəsti qoyulub. Zəmanətli Bridgestone təkərlər.  Heç bir problemi yoxdur.'),
(344, 1, 1, 1, 11, 'Mercedes', 'C 280', 1999, '2,8 L', 197, 369163, 13000, 'AZN', 0, 'Alverci deyilem,mashin menim adimadi. Xaish eliyirem ciddi insanlar zeng vursun.Yanacaq serfiyati 2.4 ferqlenmir 9litr.Yag azalmasi qeti yoxdu.Qiymet sondu'),
(345, 1, 1, 1, 9, 'Mitsubishi', 'Pajero', 2008, '3,0 L', 188, 164000, 26500, 'AZN', 0, 'Avtomaşın əla vəziyyətdədir.\nFull variantdir.\nVuruğ yoxdur. Demək olar bezkraskadir.\nYalniz sol arxa krelosunda ciziq görə rəng olub.\nTəkərlər təzədir.\nHeç bir əlavə xərc tələb etmir.'),
(346, 9, 1, 1, 9, 'Toyota', 'Land Cruiser', 2011, '4,0 L', 243, 179000, 35000, '$', 0, 'Masinin hec bir xerci yoxdur isdediyiniz servizde yoxlada bilersiz\nKredit mumkundur'),
(347, 1, 2, 2, 9, 'Toyota', 'Land Cruiser', 2011, '4,2 L', 131, 127500, 42500, '$', 0, 'Mashin ideal veziyyetdedir.Hec bir detali\ndeyishmeyib, reng deymeyib , vurugu yoxdur.\nAliciya ustunde 4 eded disk, ABS istehsali olan\nprotektorlu teker verilecek.\nIsteyen olsa qoshqu da satilir.'),
(348, 1, 2, 1, 2, 'Volvo', 'FH 13', 2012, '13 L', 460, 1051000, 62000, 'AZN', 0, 'Volvo fh13 460 Avtomat ili 2012 \nMaşin yeni gelib super veziyetdedi hec bir problemi yoxtu.'),
(349, 9, 1, 1, 11, 'Chevrolet', 'Cruze', 2015, '1,4 L', 140, 221000, 12500, 'AZN', 0, 'Chevrolet Cruze LTZ RS ,Gencededi Mawin xadavoyu ideal veziyyetdedi. Batmis capilmis Cruzelarla muqaise etmeyin  Mator karopka hec bir problemi yoxdu harda isdeyirsiz yoxlatdira bilersiz xerc teleb  etmir,  arxa stoplar led bmw stop ile deyisdirilib tekerleri tezedi 2 qat palirovka olub  pioner ses sistemi ile techiz olunub ve 3 qat keramika olunub .   elave olaraq masina stage 1 yazilib 170 at gucudu Benzin serfiyyati 100km/8.9   Otur Sur  masindi . Bos bekar ve qiymet oldurmeye gore  xaiw olunur narahat etmeyin QIYMET SONDU!!! '),
(350, 1, 2, 1, 9, 'Kia', 'Sportage', 2012, '2,0 L', 184, 209000, 28700, 'AZN', 0, 'Avtomobil ölkəyə yeni glib, cox ideal vəziyətdədi, orginal yürüşdü, bütün rasxodnikləri yenilənib, matorun yayı, karobkanın yağı, filtirlər,hamısısı dəyişilib, master klasda, şəkildə var qoymuşam, udarı vuruqu yoxdu, təkərləri əladı, polnu fuldu, hal hazırda bir manat xərci yoxdu, öz adımadı maşın'),
(351, 9, 1, 1, 11, 'Toyota', 'Camry', 2008, '2,4 L', 167, 227399, 23500, 'AZN', 0, 'Maşın 2008-ci ildə Toyota Bakı Mərkəzindən alınıb. Əl full komplektasiyadır. Ancaq servisdə xidmət olunub. Maşın qaraj şəraitində saxlanılıb. Bütün funksiyaları və hərəkət hissələri tam işlək vəziyyətdədir. Heç bir problemi yoxdur. Bütün texniki xidmətlər yenicə göstərilib. Ciddi vuruğu və udarı olmayıb. AI92 benzinlə problemsiz işləyir.'),
(352, 9, 2, 2, 3, 'Mercedes', 'Sprinter 315', 2007, '2,2 L', 109, 326000, 22700, 'AZN', 0, 'Mator 646\nQoşa turbin\nKuzanın uzunluğu.  2m 60s\nHün 170s\nEni 170s'),
(353, 5, 1, 1, 9, 'BMW', 'X5', 2005, '4,4 L', 320, 380000, 18500, 'AZN', 0, 'Satilir.'),
(354, 14, 1, 2, 11, 'Iran Khodro', 'Azsamand', 2005, '1,8 L', 100, 311200, 9500, 'AZN', 0, 'Azsamand deyil, Samand Lx-dir, yəni Azərbaycanda deyil,İranda yığılıb.Luxe salondur (full).Bu maşın  Azərbaycana reklam ücün göndərilən ilk maşın olduğundan xüsusi yığılıb,bütün detalları,motor daxil,Fransa istehsalı Pejonundur.Maşına yaxşı baxmışam,butün köhnələn detallar ən keyfiyyətli yeniləri ilə əvəzlənib,həmişə 5-6 min km. sonra ən keyfiyyətli yağ tokülüb,xodovoyu,çəkməyi əladır,maşın ən uzun məsafəyə yola rahat çıxa bilir.Bu maşını servisdə yaxşı tanıyırlar,taksi deyil,ilk gündən özümündür.Yalnız polirovkaya və ön bamperinin rənglənməsinə ehtiyac var ,başqa əla maşındır.Qiymətdə güzəşt edəcəm.'),
(355, 1, 1, 1, 11, 'Mercedes', 'C 200', 1998, '2,0 L', 136, 260420, 11500, 'AZN', 0, 'Pul lazim olduğuçün satiram,problemi yoxdu,En yaxşi Modeldi-NEMKADİ-2matordu-Lazer açar-Şarlotta buferler.UDAR YOXDU,Çürük ezik yoxdu.kraskasi eladi.Mator korofka teze kimidi.xadavoyun lazim olanlarin tezelemişem.Predokun yiğdirmişam.Tekerlin teze almişam razval eletdirmişem.akimliyatoru teze almişam.diaqnostika eletdirmişem aşibkasi yoxdu.salonu teze kimi seliqeli saxlamişam.Kondisoneer buz kimi,şüşe qaldiranlar qapilarin pult sistemi her funksiyasi tam işlekdi.Rengi göy metalikdi.Senedleri düzgündü cermesi hepsi yoxdu'),
(356, 15, 1, 1, 6, 'Ford', 'Mustang', 2017, '2,3 L', 309, 83000, 38000, 'AZN', 0, 'Tecili'),
(357, 5, 1, 1, 11, 'Volkswagen', 'Passat', 2006, '2,0 L', 150, 185000, 6500, 'AZN', 0, 'Oz wexsi mawinimdi...sade matordu...xadavoy yaxwi veziyetdedi...kandisaner buzkimi iwdeyir...kowa salon...mawinin yungul kasmetika iwine ehtiyaci var...tecili satilir...'),
(358, 9, 2, 2, 4, 'Opel', 'Astra', 2005, '1,3 L', 90, 153000, 10350, 'AZN', 0, 'ORJINAL PRABEQ!!!!!! ALMANYA.\nOlkemize 10 gun yoxdu gelib.Masin ideal veziyyetdedir!\nHec bir prablemi yoxdur passiz, vuruxsuz, udarsiz masindi! Ureyiniz harda istese yoxladira bilerik!\nKatalizator orjinal ustunde!! Masin Tam ideal veziyyetdedi! Kandisioner ideal!! Serfiyat 4-5 litr!! Suzi endirim olacaq!! Bu prabeqnen bele mawin retki olur bilenler bilir! Qiymet sondu!! Pul lazim oldugu ucun bu qiymete satilir'),
(359, 1, 2, 2, 3, 'Ford', 'Transit', 2007, '2,2 L', 130, 235136, 17000, 'AZN', 0, 'Almanyadan yeni gəlib.təkərləri təzə .kondisioner.yağış sensoru.sidenka qızdırıcı.maşın ideal vəziyyətdədir.istənilən yerdə yoxlada bilərsiz.'),
(360, 5, 1, 1, 11, 'Mercedes', 'C 220', 1995, '2,2 L', 150, 301012, 10800, 'AZN', 0, 'Masin yaxsi veziyetdedi otur sur masindi.Ozune ideal ceska axtaran narahat ede biler.Masinda birdenede problem yoxdu.Real aliciya cuzi endirim olunacaq masina baxdiqdan sonra.'),
