(362, 6, 2, 1, 11, 'Kia', 'K7', 2016, '2,2 L', 202, 130000, 25800, '$', 0, 'Koreyadan yeni gəlib. \nMaşın sinifinin Fuludu. Hərşey işlək vəziyətdədi. Çox səliqəli sürülüb. Orginal probeq. Harda istəsəniz yoxlatıra bilərsiz. \nAlverçi deyiləm. Bütün rasxodları dəyişdirilib. Matorun yağı, filtiri, kondisonerin filtiri, hava filtiri, yanacaq filtiri, eva ayaqlatılar tiktirmişəm. \nParilovka və ximçistka olunub. \nŞəxsi özümçün almışdım. Pula ehtiyac olduğundan satası oldum. \nBir sözlə heç bir rasxodu yoxdu. \nNÖMRƏSİZ SATILIR. \n08:00-22:00 aralığında əlaqə saxlaya bilərsiniz.'),
