(446, 1, 1, 2, 9, 'LADA (VAZ)', 'Niva', 2014, '1,7 L', 80, 145000, 9400, 'AZN', 0, 'Maşın yaxşı vəziyyətdədir. Mator Most Karobka ideal. Razdatkası işləkdi. Real alıcılar narahat etsin. Son qiymət maşına baxdıqdan sonra danışılacaq. Real aliciya endirim olunacaq.'),
(447, 6, 2, 2, 12, 'Kia', 'Ceed', 2008, '1,6 L', 115, 200200, 149000, 'AZN', 0, 'Mashin Almannan 5 gundur gelib. Vurugu udari deyishen detali ve ya Pasi curuyu qeti yoxdur! Cox seliqeli ve baximli salonu var,kosmetik ishi yoxdur. Tekerler dordude tezedir.'),
(448, 5, 1, 2, 11, 'LADA (VAZ)', '2107', 1985, '1,6 L', 75, 358508, 3400, 'AZN', 0, 'Masin yaxsi salanat masindir udar gormuyub bakavin stekan zavoddu.Kosmetikasi zeifdi. Barter 07 ili 90 dan yuxari yaxsi masin olsa pulda vererem istunde'),
(449, 6, 1, 1, 4, 'Opel', 'Astra', 2003, '1,6 L', 105, 234000, 8700, 'AZN', 0, 'Salam. Maşın 2018 - çi ildən məndədir. 2 çi maşın kimi istifadə olunur.yungul kasmetikaya və 2 təkərə ehtiyacı var. Sadə matordur. Xahiş edirəm ciddi olanlar əlaqə saxlasın. Saat 22:00 dan sonra yıgib narahat etməyin. Alverçi deyiləm öz maşınında aldığım ildən öz adımadir. Diqqətiniz üçün təşəkkür edirəm.'),
(450, 15, 1, 1, 11, 'Volkswagen', 'Passat', 2009, '2,0 L', 200, 139000, 11700, 'AZN', 0, 'Avtomabil cox ideal veziyetdedir\nHec bir xerci yoxdur\nVuruq udardan soz gede bilmez\nMator ne tustulemir nede seli islemir\nKaropqa ne vurmur nede gecikmir\nSade karopqadir\nSalonu olduqca cox seliqelidir teze kimidir\nCox baximli masindir\nBele Passata cox nadir halarda rast gelmey olar\nBuna baxib bilen alib aparacaq \nSenedleri tam qaydasindadir'),
(451, 1, 1, 3, 11, 'Nissan', 'Maxima', 2012, '3,5 L', 290, 167000, 25000, 'AZN', 0, 'Mashın ela vezıyyetdedı hecbır problem yoxdu,Istenılen yerde yoxlanıla bıler.'),
(452, 2, 1, 2, 13, 'GAZ', '330200', 1998, '2,4 L', 100, 160000, 6500, 'AZN', 0, 'Maşın xərc tələb etmir.Tam saz vəziyyətdə.. Tekerler 6-da təzə akulmyator karbirator elektrik sistemi hamısı teze.Ramada çat yoxdu Rama usilini olunub.. Resorlar ela yükə tam hazır..Matoru iyun ayında yiqlib'),
(453, 9, 1, 1, 11, 'Mercedes', 'C 220', 1995, '2,2 L', 150, 459000, 9250, 'AZN', 0, 'Salam. C200  2 matordur m111 yuxarida sehv olub. Masin cox yaxsi veziyetdedir. Hecbir problemi, udari qetiyyen yoxdur. 2 ildir mendedir ne lazimdirsa etmisem. Real alici ustasi ile gelsin.'),
(454, 11, 1, 1, 11, 'Mercedes', '190', 1992, '1,8 L', 109, 400000, 5900, 'AZN', 0, 'usta mawinidir,hec bir xerc teleb etmir,bow adamlar narahat  etmesin'),
(455, 1, 1, 1, 9, 'Toyota', 'Prado', 2015, '2,7 L', 167, 79000, 35300, '$', 0, 'Salam.Avtomobil 2016 ci ilin mart ayinda resmi dilerden alinib.Bugunedek servisde qulluq olunur.Avtomobilin vurugu udari,kraska deyen yeri qetiyyen olmayib.(buferde kusok kraska var)Orijinal probeqdi.Alici servizde yoxlada biler.Servizde satilan gunden bugunedek her yagdeyiwmede probeqle bagli qeydler aparilir.Cox seliqeli avtomobildi.'),
(456, 6, 2, 2, 4, 'Kia', 'Rio', 2005, '1,5 L', 109, 344000, 10800, 'AZN', 0, 'Masin ela veziyyetdedi hec bir problemi yoxdur.matoru xadavoyu en esas kuzasi super veziyyetdedir.fikri ciddi olan wexsler narahat etsin.'),
(457, 1, 1, 1, 11, 'Hyundai', 'Sonata', 2015, '2,0 L', 165, 142000, 31500, 'AZN', 0, '2020-ci il 4 noyabrda Koreyadan ölkəyə özümçün gətizdirmişəm. İdeal vəziyətdədir. Heç bir problemi yoxdur. Harda istəsəz yoxlada bilərsiz. İl 2015 alış 2016. ORGİNAL PROBEQ 142000km. 2.0 sade motor. 92 benzinlə rahat işləyir. 3 rejimi var : sade, eco və sport. Tam fulldu. Ponarama lyukdan başqa. Damına özüm vinil vurmuşam. Damında heçbir problem yoxdu. Yerində vinil sökülüb baxıla bilər. Vinilsiz şekli var. Dəri salon, oturacaqlarin isidilmesi, soyudulmasi, Multi rol, usb aux Cd DVD, monitor, arxa və qabaq görüntü video registrator, park radar, oturacaqların qızdırılması və isidilməsi, sükanın qızdırılması və s..... Bir sözlə çox ideal maşındı. Heç bir problemi yoxdu. Maşına çox gözəl baxılıb. Maşın öz adımadı. NÖMRƏNİDƏ üstündə pay verirem. \n08:00-dan 22:00-dək əlaqə saxlaya bilərsiz '),
(458, 9, 1, 1, 11, 'BMW', '328', 2015, '2,0 L', 245, 180000, 30000, 'AZN', 0, 'Tam ideal vəziyyətdədir.Heç bir problemi yoxdur.Ürəyiniz istədiyi servisdə yoxlatdıra bilərsiz.\nKredit mümkündür:\nİlkin ödəniş 9500 azn, 24 ay 1280 azn.\nİlkin ödəniş 9500 azn, 36 ay 950 azn.'),
(459, 5, 1, 2, 9, 'LADA (VAZ)', 'Niva', 2013, '1,7 L', 80, 44000, 12800, 'AZN', 0, 'Avtomobil yaxşı vəziyyətdədir.Əlavə olaraq bmw oturacaqlar,oturacaq qızdırıcı,kondisioner,yeni disk təkər,Bahalı maqintola ,6 ədəd pioneer kalonka, usilitel,powerbank,ferrium pribor,euro şit v.ə.s mövcuddur. Real alıcıyla qiymətdə razılaşmaq olar.'),
(460, 9, 1, 1, 11, 'Mercedes', 'C 180', 1998, '1,8 L', 122, 367215, 13400, 'AZN', 0, 'Salam. Maşın ideal vezyetdedir heçbir problemi yoxdur 4-ildir özümdedir öz adımadır Almanya’dan gelenden ikinci sahibiyem baxımlı maşındır motor,most,karopka ideal kandisaner buz kimi vurur. Diskleri çatsız suvarkasız vuruğ udar söhbeti gede bilmez çekic bele deymeyib pası çürüyü yoxdur altı üstündende temizdir ZAVOD maşındır orginal probeqdir. Bir sözle çox ideal maşındır şeherde tek-tükdür bele vezyetde çeşka xaiş edirem gelen ustası ile gelsin herbirşeyine cavabdehem. Boş bekar adamlar narahat etmesin!'),
(461, 5, 1, 2, 4, 'LADA (VAZ)', '2109', 1989, '1,5 L', 78, 128106, 5500, 'AZN', 0, 'Masin sekilde gorunduyu kimidi karobka şuplu 015 karobkasi teze deyisilib çaşqa feredo qrusitel sistemi rul sport lada tormuz sistemi vakumu arxa kalotkalar sadaladiglarimin hamisi yenisi ile evez olunub qabaq oturacaglarin isidilmesi var isliyir qabaq şüşeler avtomatik bir sozle hec bir xerc teleb etmir öz adimizadi alverci deyilem 2ci masin kimi istifade olunub zovqe gore yigilib telefonda qiymet sohbeti elemiyin qiymet ancaq masinin yaninda  bos bekar adamlar narahat etmesin barter ancaq universal opel astra g'),
(462, 6, 1, 1, 11, 'Mercedes', 'E 240', 2002, '2,4 L', 170, 306000, 15800, 'AZN', 0, 'Maşın ideal vəziyyətdədir. Heç bir çürüyü yoxdur. Təkərlər təzədir. Kondisioner işləyir.Lyuk işlək vəziyyətdədir. Heç bir problemi yoxdur. Barter yoxdur.'),
(463, 16, 1, 2, 11, 'Mercedes', 'E 220', 1994, '2,2 L', 150, 330000, 7200, 'AZN', 0, 'Bahalı nömrə ilə satılır, ailə maşınıdır,heç bir xərc tələb etmir, kondisioner tam işləkdir.Tecili satılır reali alıcıya qiymətdə endirim edərəm.'),
(464, 5, 1, 2, 11, 'Khazar', 'LX', 2019, '1,7 L', 117, 47058, 12500, 'AZN', 0, 'Təcili satılır. Mator, karopka, peredok əla vəziyyətdədir. Taksidə istifadə olunmayıb. Kraska dəyən yeri var,  amma udarı yoxdu. Maşın Qarabağ əlilinin adınadı. Davernus veriləcəy. Problemsiz maşındı. Alverçilər narahat eləməsin. Marağlanmağ istəyən wp ilədə əlaqə saxlıya bilər. Qiymətdə razılaşmağ olar.'),
(465, 1, 1, 1, 9, 'Mitsubishi', 'Pajero io', 2000, '1,8 L', 130, 201653, 8500, 'AZN', 0, 'Masin yaxsi veziyyetdedi.isdenilen usdada yoxlada bilersiz.barter ve kredit mumkundur.'),
(466, 9, 1, 1, 4, 'Mercedes', 'B 170', 2008, '1,7 L', 116, 65559, 14800, 'AZN', 0, 'Maşın super vəziyyətdədi hec bir prablemi yoxdur cölündə icində birdənə belə cız yoxd altı üstü səliqəlidir bir xal yoxdu bel kimin nə sualı olsa zəng edib maraqlana bilər qiymətdə razılaşmaq olar '),
(467, 1, 2, 2, 1, 'MAN', 'Temsa', 1986, '11 L', 420, 500000, 42000, 'AZN', 0, 'Salam. Man 49 yer. komandor motordu. Antifrizdi. Turbin, interkuler ve filterler yenilenib. Baqaj fibradan yeniden yigilib.'),
(468, 9, 1, 2, 11, 'Khazar', 'SD', 2020, '1,7 L', 113, 143765, 14500, 'AZN', 0, 'Ilk odenis 5800 22 ay 397 manat. Hec bir xerc teleb etmir. Xarice getdiyim ucun satiram'),
(469, 9, 2, 1, 11, 'Mercedes', 'E 220', 1999, '2,2 L', 143, 288956, 16000, 'AZN', 0, 'Heç bir xərc tələb etmir salonda hər bir funksiyaları işləydir baxmaq isdeyen buyurub gələ bilər harda isdesez yoxlada bilərsiz '),
(470, 9, 1, 1, 9, 'Kia', 'Sorento', 2014, '2,4 L', 175, 104000, 22000, '$', 0, 'Mashinin vurugu udari olmayib, reng deymeyib. Servis masinidir, ancaq servisde qulluq olunub. \nHech bir problemi yoxdur. \n\nIstehsal 2013 alish 2014 dur. Modelinin en full versiyasidir.'),
(471, 3, 1, 1, 11, 'Mercedes', 'E 200', 1999, '2,0 L', 136, 322000, 13200, 'AZN', 0, 'Salam maşın 1999 2000 modeldi.İdeal vəziyyətdədir.İki sadə matordur.salon səliqəlidir.Trasda 7,5 Şəhər içi 9 litr yanacaq sərf edir.Kosmetikaya ehtiyyacı var.Təkərlər təzədir.Vuruq udar qətiyyən yoxdu.Harda istəsəniz yoxlada bilərsiz.Real alıcıya endirim olunacaq.Mator most ideal vəziyyətdədir');
