(473, 9, 1, 2, 11, 'Tofas', 'Sahin', 2006, '1,6 L', 86, 650000, 6600, 'AZN', 0, 'Hec bie problem yoxdur . Masini deyismek ucun satiram . Qiymeti masinin yaninda danismaq olar .'),
(474, 1, 1, 1, 11, 'BMW', '525', 2000, '2,5 L', 192, 314000, 12400, 'AZN', 0, 'Mawin yaxwi veziyetdedi tecili satilir barter eliyerem baxir mawina ne prablemi olsa qiymetden cixilacaq'),
(475, 1, 1, 1, 11, 'Toyota', 'Camry', 2007, '2,4 L', 167, 264842, 18200, 'AZN', 0, 'Her kese salam olsun.Maşin Servis maşinidi.deri salondu her bir funksiya işlekdi.Kondisaner işlekdi.\nDemek olaraki maşin iline göre idyal veziyyetdedir.İstelinen yerde yoxladira bilersiz.Guzgülerin acilib baqlanandi,sideniyalar qizdiricidilaridir.Allah alanada satanada xeyir versin.'),
(476, 1, 2, 2, 13, 'Mercedes', 'Atego 2528', 2000, '6,5 L', 999, 621760, 39700, 'AZN', 0, 'Salam. Maşın əla vəziyyətdədir. Maşının arxa  qalxıb enən dingili və dingilin dönməsi, avtomatik mexaniki hissələrin yağlanması sistemi, yeni əlavə edilmiş 1,3 ton yanacaq çəni, arxa qoşqusu, lapatqası, mərtəbələr arası qalxıb enən mexanizmi, yığılıb açılan jalüzü, çadırı, stayaçi peçi, yeni təkərləri, təzə akumliyatorları var. '),
(477, 1, 1, 2, 11, 'LADA (VAZ)', '2107', 2007, '1,6 L', 75, 156333, 6500, 'AZN', 0, 'Mator most karopka super 4 teze teker pult sistemi opsu bez sumka qara salon kosmetika super deyesen detal 1 kreldi qalan zavod oxudu cox tecili satilir real aliciya endirim olunacax'),
(478, 1, 2, 2, 12, 'Opel', 'Astra', 2007, '1,3 L', 90, 317000, 10500, 'AZN', 0, 'Mawin Azerbaycana gelenden mende olub 2019 birinci eldi veziyeti yazaidi kosmerik iwleri var razilawmaq olar'),
(479, 9, 1, 2, 11, 'LADA (VAZ)', '2115', 2012, '1,6 L', 80, 221000, 8800, 'AZN', 0, 'Herkese salam Masin tam ideal veziyetdedi hec bir problimi yoxdu. Zavod bez detaldi otur sur masindi.\nMasin saray qesebesindedi. Cox tecili satilir'),
(480, 9, 1, 1, 11, 'Daewoo', 'Gentra', 2014, '1,5 L', 107, 180000, 14500, 'AZN', 0, 'Masin ideal veziyyetdedir Hec bir problemi yoxdur.Ful salon dur lyuk var \n\nMercedes maybach 2022 sukan - Qizdiricisi multi rulu islekdir\n\nmercedes maybach stop\nmercedes S Fara\nMercedes Maybach Radiator barmagligi\nMercedes S deflektor\nmercedes S ambians gizli isiglar telefonla deyisen\nMercedes g55Monitor\nAparatura -650,700,750kalonka usilitel 71.50maqintafon\n\nSalon qapilar Bardovu reng  orginal deri ile uzlenib \nPaneli renglenib Bardovu ustu orginal qara koja cekilib\nDam alikantar\nher bir seyi orginaldir masin Tam dolu masindir\ncuzi isi var cox az 50-100 azn Maksimum\nMasinda elave olaraq\nzavod diskleri + 4 Teze teker alinib\nYagi mator ve karobkanin 2Gun evvel deyisilib\n\n1. R17 disk teker Alpine diskler\n2. mercedes Maybach yigilan tuning bufer\n\nCox Tecili Satilir..Masin capilan masin deyil sadece zovqle yigilib surulur .Masinda her sey idealdir tek oturacaqlara cexol almaq lazimdir maddiyata gore oturacaqlari yiga bilmedim..Qiymeti yaninda danisilacaq Otur sur masindir \n'),
(481, 1, 1, 2, 4, 'Hyundai', 'i30', 2007, '1,4 L', 109, 185300, 12900, 'AZN', 0, 'Orginal kotalizatoru ustundedi \nSes sistemi JBL kalonkalari ile evez olunub \n1 yaxsi moqnitafon qoy ses partdasin\nDiskler elantra durusu vidi fasonu cox gozel avtomobildi\nTekerler ve motorun yagi yenidi'),
(482, 9, 3, 1, 11, 'Toyota', 'Camry', 2022, '2,5 L', 218, 0, 48540, '$', 1, '10 il və 160.000 km rəsmi zəmanət❗️❗️❗️\n1 illik kasqo siğorta hədiyyə❗️❗️❗️\nStart/Stop❗️❗️❗️❗️\nDəri salon(Zavod istehsalı)❗️❗️❗️\nÖn oturacağların qızdırıcısı❗️❗️❗️\nÖn oturacağların düymə ilə idarə olunması❗️❗️❗️\nSimsiz telefon sarj etmək❗️❗️❗️\nArxa görüntü kamera❗️❗️❗️\nÜnvan:Babək pr\nAvtosalon040(Şirxan)'),
(483, 9, 2, 2, 12, 'Opel', 'Astra', 2007, '1,3 L', 90, 290000, 11000, 'AZN', 0, 'Salam mawin yaxwi veziyyetdedi . Az xercleri var pulunnan cixilacaq rasxodnikleri deyiwilib. Maxavik feredo vijivnoy ,turbo,yanacaq nasosu,dinamo,akkumlyator,su pompasi,matorun ic sepi,4 teze teker,apornulari ve nakladkalari yenilenib'),
(484, 15, 2, 1, 9, 'Kia', 'Sorento', 2011, '2,0 L', 184, 155000, 28000, 'AZN', 0, 'Amartizatorları mersedesə yığılıb.vuruq udar yoxdur,harda isdəsəz yoxlada bilərsiz.'),
(485, 9, 1, 1, 11, 'Mercedes', 'E 320', 2000, '3,2 L', 224, 375000, 13400, 'AZN', 0, '2 ci avtomobilimdi.Az surulur.2 avtomobilimin 2 side sedandi.Bunu satib Jip hundur masin almaq isteyirem.Masinda ciddi problem hec ne yoxdu.Real almaq isteyene endirimde eliyerem'),
(486, 6, 2, 2, 8, 'Renault', 'Scenic', 2007, '1,5 L', 106, 306000, 9300, 'AZN', 0, 'Avtomobil ideal vəziyyətdədir. 3 ilə yaxındır, məndədir.\nHeç bir problemi yoxdur. Ümumiyətlə motor, karopka əla vəziyyətdədir. Hər bir şey işlək vəziyyətdədir. Taksidə sürülməyib. İstənilən yerdə yoxlatdıra bilərsiniz. Dizeli ancaq Lukoildan vurmuşam. 100-ə 5 litr dizel işlədir. Alan heç vaxt peşman olmaz. Əsil ailəvi maşındır.'),
(487, 9, 2, 2, 12, 'Renault', 'Laguna', 2009, '1,5 L', 110, 205000, 11000, 'AZN', 0, 'Yaxshi veziyyetdedir hec bir xerci yoxdur ideal mashindi xarice getdiyime gore satiram real alici elaqe saxlasin.'),
(488, 6, 1, 1, 11, 'Mercedes', 'E 320', 2000, '3,2 L', 224, 176000, 13500, 'AZN', 0, 'Masını özüm ücün yqmsam alan adam isdənilən usdaya aparsın 1 yerində praplem ola bilməz xerc tələb etmir masn təcili pul lazm olduqycun satram'),
