(490, 1, 1, 1, 11, 'Chevrolet', 'Cobalt', 2022, '1,5 L', 106, 0, 22100, 'AZN', 1, 'Chevrolet Azermash CP\nYeni model Cobalt LTZ2022\nAvtomobilde movcuddur\nEleltrik suse qaldiranlar\nKondisioner\nUSB\nABS\nYungul lehimli diskiler\n195/65/15\nNagd kocurme ve lizing vasitesi ile satis movcuddur\nLizing sertleri\nIlkin odenis 4000Azn\n60ay 479azn\n48ay 553azn\n36ay 661azn\n24ay 940azn\n12ay 1726azn\nZemanet 3il ve ya 100000km\nQeyd; Qiymete DYPI qeydiyyati daxil deyil.'),
