(494, 9, 1, 1, 9, 'Porsche', 'Cayenne', 2006, '3,2 L', 250, 300000, 21000, 'AZN', 0, 'Masin tam ideal veziyyetdedir hec bir xerc teleb etmir.Mator karopka peredok ela veziyyetdedir.Masin sekilde gorunduyunden eladir.Lazimi olan ne varsa yenisi ile evez olunub'),
(495, 9, 3, 3, 4, 'Toyota', 'Prius', 2008, '1,5 L', 76, 308994, 14000, 'AZN', 0, 'Shexsi  mashinimdir , ela veziyyetdedir .'),
(496, 9, 2, 1, 8, 'Mercedes', 'Vito 116', 2012, '2,2 L', 163, 197000, 21000, '$', 0, 'Salam maşını 2018 də Almaniyadan özüm gətizdirmişəm,vurduğu udarı yoxdur,Kuza zavod kraskasıdı,buferlər rənglənib,maşın öz həyət evimdə navesin altında gün yağış dəyməyən yerdə saxlanılır,2 ci maşın kimi yalnız ailə üçün sürülür,taksidə və yaxud turistlərlə heç bir işə qoşulmayıb,KUZA EXTRALONGDUR,kondisioneri əla işləyir,təkərlər Orjinal Petlas 10000 sürülüb,maşın 2018 də gətiriləndə 170 min probeqlə gəlmişdir! Gətirdiyim gündən yağ Yalniz Mercedes Benz orjinal 5/30 tökülüb( 1 litr 17 man),Filterlər MAN -la dəyişilib,maşın ideal vəziyyətdədir,Əlavə olaraq maşının üstündə gələn qara yan şüşələr veriləcək cızığsız ideal vəziyyətdədir!YALNİZ REAL ALICILAR NARAHAT EDƏ BİLƏR!!! '),
(497, 5, 1, 2, 12, 'Opel', 'Astra', 2005, '1,4 L', 90, 217580, 10800, 'AZN', 0, 'hec bir problemi yoxdu..motor,karobka,əla vəziyyətdədir..faralar restalinq,təkərlər yeni,blutuz,avtopilot,multi rul..istənilən yerdə yoxladıb tam əmin ola bilərsiz..qiymətdə cüzi endirim ola bilər..əlavə suallar telefon vasitəsilə'),
(498, 6, 1, 1, 11, 'Mercedes', 'C 200', 2000, '2,0 L', 136, 314700, 12800, 'AZN', 0, 'Mashin yaxwi vezyetdedi elave sual olsa zeng vurun.'),
(499, 9, 1, 1, 9, 'Hyundai', 'Santa Fe', 2012, '2,4 L', 175, 162000, 30800, 'AZN', 0, 'Masin super veziyyetdedir \nHundai otoplazadan alinib( Bakidan )\nServis masinidi 4wd \n7 neferlik 4 cekendi\nPolnu Fulldu(acarin)\nVuruq udar deyisen hisse kankret yoxdu \nSuper durusdu santafedi\nSeliqeli ve temiz saxlanilib\nUstu opsi ponaramadi\nMator karopka peredok yaxsi veziyyetdedir \nProblemi yoxdu \n'),
(500, 6, 1, 1, 4, 'Nissan', 'Tiida', 2011, '1,5 L', 109, 45000, 14000, 'AZN', 0, 'Avtomobili olkeye yeni getirmisem.Ilk Sahibiyem.Oz adimdadir.Kendisioner,arxa goruntulu kamera,qaranliq sensoru,led isiqlar,zavod qara suseler,4 suse qaldirici,acarciz acilib baglanma,acarsiz ise salma,qatlanan guzguler ve diger funksiyalar movcuddur.Avtomobilin yurusu orjinaldir.Olduqca ideal avtomobildir.Temiz ve cox seliqeli salonu vardir.Oturacaqlarin yan terefleri deridir.Hec bir problemi yoxdur.Real almaq isteyen buyurub zeng ede biler.'),
(501, 10, 1, 2, 13, 'HOWO', 'Sinotruk', 2008, '10 L', 336, 800000, 48000, 'AZN', 0, 'Arxasinda prisepi var saz vezyetdedir'),
(502, 1, 1, 2, 11, 'BMW', '320', 2007, '2,0 L', 170, 317000, 13500, 'AZN', 0, 'Maşında vuruq olmayıb. Mator, karobkada heç bir prablem yoxdur, mator yağ yemir. Salon dəridir və səliqəli vəziyyətdədir. Original F30 diskləri qoyulub. Maşın öz adımadır. Maşına baxdıqdan sonra kiçik xərclər qiymətdə nəzərə alınacaq.\nNömrə razılığa gəlsək maşında saxlanıla bilər.\nReal alıcıya yalnız maşına baxdıqdan sonra qiymətdə endirim ediləcək.'),
(503, 6, 1, 1, 11, 'Mercedes', 'C 200', 1996, '2,0 L', 136, 446000, 9000, 'AZN', 0, 'Masin yaxsi vezyetdedir yungul kasmetik isleri var.Təcili satmiram!'),
(504, 3, 2, 2, 12, 'Renault', 'Megane', 2006, '2,0 L', 150, 300000, 9500, 'AZN', 0, 'Qiymet barede ancax masina baxdiqdan sonra cuzi endirim ederem'),
(505, 15, 1, 2, 4, 'Kia', 'Rio', 2009, '1,4 L', 97, 145000, 11900, 'AZN', 0, 'Salam.masin ideal veziyyetsedir.hec bir xerc teleb etmir.tekerler,akumulyator,yag ve antifrizi teze deyisilib.Ölkeye kecen il gelib.takside qeti surulmeyib.masina baxsiqdan sonra qiymetde razilasmaq olar.ALVERCILER qeti narahat etmesin.'),
(506, 15, 1, 1, 11, 'BMW', '525', 2008, '2,5 L', 218, 179200, 23500, 'AZN', 0, 'Masinin probegi orjinal Alman masini vurugu yok hic bir problemi yok. Kesinlikle yag yemegi yoktur.'),
(507, 9, 1, 1, 9, 'Infiniti', 'FX35', 2007, '3,5 L', 280, 237500, 18000, 'AZN', 0, 'Bu geceye ozel qiymet.Sabaha qalsa qiymeti qalxacag\n\nIntelligent Cruise Control\n*Bi-Ksenon faralar.\n*INFINITI Entry & Drive (Açarsız giriş sistemi)\n* Ikili climat control\n* Arxa kamera\n*Parklama sensorları(on ve arxa)\n*Prisoska baqaj qapısı\n*20 - lik disklər\n*Disklərin mərkəzində rəngli INFINITI emblemi\n*BOSE səs sistemi\n\nSalam, maşın S50 Restyle Dubaykadı. Original probeq, motor korobka saz vəziyyətdə yağ olarağ Liqui-Moly 5w-40 istifadə olunur. Elektronika hər bir funksiya işlək vəziyyətdədi\nAvtomibilə əlavə olarağ H&R firmasının tam orginal olan 20mm spacerleri və qluşitel sistemi yığılıb çox gözəl səsi var tam qanuni şəkildədir \nAvtomobil 2006 ci ilin 11ci ay buraxılış 2007ci ildə xususi sifarişle Bakıya 0km olarağ gətirilib\nBu doluluğda infiniti şəhərdə çox çox azdır\nAvtomobilin vuruğu olmayıb, bufer və xırda hissələr çoxsaylı cızıqlara görə rənglənib 3detalda sadece uzden kraskalanib demir hissesinde hec bir is gorulmuyub spaplofkasiz kraska vurulub avtomobil cox hissesi bezkraskadir'),
(508, 9, 1, 1, 4, 'Mercedes', 'B 170', 2008, '1,7 L', 116, 156000, 12500, 'AZN', 0, 'Mator karopka idealdır.Kuzada vurug udar qəttiyyən yoxdur.4 təzə təkər. Bütün funskuyaları işləkdir. Heç bir xərci yoxdur.Alıcı istənilən servisde yoxlada bilər.');
